INSERT INTO `challenge` (`id`, `created_date`, `modified_date`, `challenge_img`, `content`, `description`, `level`, `like_num`, `name`, `state`, `member_id`) VALUES
	(1, '2022-08-16 22:19:03.022441', '2022-08-17 17:29:14', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F1?alt=media&token=c5a11823-902c-4147-af67-04badf01beaf', '<p><strong class="ql-size-large">독서를 즐기고 싶지만 마땅한 시작점을 찾지 못했다면 무라카미 하루키의 책으로 소설읽기를 시작해보는건 어떨까요</strong></p><p><br></p><blockquote><strong>Stage 1: 노르웨이 숲</strong></blockquote><blockquote><strong>Stage 2: 해변의 카프카 1, 2</strong></blockquote><blockquote><strong>Stage 3: 기사단장 죽이기 1, 2</strong></blockquote>', '무라카미하루키의 책은 마치 한 곡의 재즈를 듣는듯한 기분이 듭니다. \n어디로 나아갈지 모르는 이야기의 긴박함과 인물들의 기막힌 심리묘사가 지루할 틈이 없게 만들죠.\n올 여름 무라카미 하루키와 함께 소설의 매력에 흠뻑 빠져보는건 어떨까요?\n\n', 2, 5, '무라카미하루키의 소설에 흠뻑 빠져보기 🌊', 1, 3),
	(2, '2022-08-16 22:26:50.766428', '2022-08-17 00:53:15', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F2?alt=media&token=17f5da22-9e98-4a4d-8164-797d05ef4312', '<p><strong class="ql-size-large">5단계의 운동</strong><span class="ql-size-large">을 진행해봅시다!</span></p><ol><li>스트레칭하기</li><li>스쿼트</li><li>벤치프레스</li><li>데드리프트</li><li>유산소</li></ol><p><br></p>', '운동을 시작해봅시다.', 1, 2, '헬스 시작하기', 1, 8),
	(4, '2022-08-16 22:59:30.563745', '2022-08-16 23:22:48', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F4?alt=media&token=5147bc77-d7af-47ba-9cb9-17c852e3eb63', '<p class="ql-align-center"><strong class="ql-size-huge">당구 </strong><strong class="ql-size-huge" style="color: rgb(178, 178, 0);">초보</strong><strong class="ql-size-huge">를 위한 강의입니다.</strong></p><p><br></p><p><span class="ql-size-large">매번 당구칠 때마다 계산하러 가시나요?</span></p><p><br></p><p><span class="ql-size-large">당구의 </span><span class="ql-size-large" style="color: rgb(0, 138, 0);">이론</span><span class="ql-size-large">을 알고 치시면 실력이 쭉쭉 상승합니다.</span></p><p><br></p><ol><li><span class="ql-size-large">자세</span></li><li><span class="ql-size-large">스트로크</span></li><li><span class="ql-size-large">두께</span></li><li><span class="ql-size-large">당점</span></li></ol>', '친구들과 당구칠 때 ATM기가 되기 싫으신 분들 다 들어오세요~', 1, 0, '당구 초보만', 0, 4),
	(5, '2022-08-16 23:08:51.451502', '2022-08-18 11:22:41', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F5?alt=media&token=f33ec4ab-535f-49d0-9671-dddfe8f4daeb', '<p>고슴도치를 키우는 단계를 3단계로 나눠서 클리어해봅시다!! </p><blockquote>살아있다는 것은 어느 또 다른 삶의 무게를 짊어질 수도 있다는 것이다. By 범재 조성민 선생</blockquote><p><br></p>', '고슴도치를 키워보신 적이 있나요?', 3, 2, '고슴도치를 잘 키워보자!', 1, 11),
	(6, '2022-08-16 23:54:16.092475', '2022-08-18 22:58:45', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F6?alt=media&token=f6104e0c-bbce-4cf4-bcb0-41d5788c0890', '<p>코딩 테스트에 꼭 나오니까 반드시 알아야 할 알고리즘 유형 4 개 중에서 1개씩 뽑아서 같이 풀어보아요!</p><p><br></p><p>포스팅으로는 문제를 해결한 정답 코드를 올려주세요! </p>', '코딩 테스트를 위한 알고리즘 공부 힘드셨죠? 차례차례 어떤 순서로 공부할지 알아봅시다!', 3, 2, '오체풀만족과 함께 하는 알고리즘 차례차례 공부해보기!', 1, 11),
	(7, '2022-08-17 01:33:19.058704', '2022-08-17 17:26:37', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F7?alt=media&token=cbdcd7f5-6a6d-432a-8bd1-f4d342950021', '<p>제 나이 27살, 자취 시작한지 8개월 차입니다. 그동안 익히고 느껴온 것들을 공유해볼까 해요. 다들 즐거운 자취러가 되봅시다!</p>', '자취 시작한지 어언 8개월 하고도 17일... 그동안 쌓인 요리 노하우를 배워보실래요?', 2, 4, '자취 요리, 기본만 익혀봅시다', 1, 11),
	(8, '2022-08-17 01:34:33.045566', '2022-08-17 16:09:48', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F8?alt=media&token=19d97cf7-9bd8-4ac0-aa18-ccc5f285bfb8', '<p>악필에서 벗어나 이쁜 나만의 글씨를 써보기</p>', '캘리그라피를 시작해보자!', 2, 4, '캘리그라피', 1, 1),
	(9, '2022-08-17 02:11:19.532881', '2022-08-17 02:14:54', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F9?alt=media&token=75f6d1e2-e57e-4d1b-a4a5-3298567fa83c', '<p><span class="ql-size-huge" style="color: rgb(230, 0, 0);">파스타</span><span class="ql-size-large">를 만들어 봅시다!</span></p><ul><li>밖에서 사먹으면 만오천원! 집에서 먹으면 한끼에 3천원! </li><li>건강에도 좋아 맛도 좋아 지중해의 토마토의 향기를 느껴보아요</li></ul>', '맛난 파스타를 만들어 보야요', 2, 0, '파스타 만들기', 1, 8),
	(10, '2022-08-17 02:20:35.829176', '2022-08-17 02:28:10', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F10?alt=media&token=938e339e-4a0d-46d7-a46a-59cbac2a9068', '<ul><li>나날히 발전하는 경제사회에서 새로운 음식에 대한 관심이 높아지고 있다.</li><li>요즘들어 등장하는 오마카세. 우리도 한번 먹어보자 그 오마카세</li></ul><p><br></p><ul><li><span class="ql-size-huge">준비해야할 것</span></li></ul><ol><li><span class="ql-size-large">아주 좋은 회칼</span></li><li><span class="ql-size-large">먹고싶다는 의지</span></li><li><span class="ql-size-large">좋은 횟감을 살 수 있는 </span><strong class="ql-size-large" style="color: rgb(153, 51, 255);">자본주의적 축복</strong></li></ol>', '맛난 스시를 만들어봐요', 3, 0, '스시를 만들어보자', 1, 8),
	(11, '2022-08-17 03:14:30.528878', '2022-08-17 17:24:45', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F11?alt=media&token=3c1ac21c-e352-417c-890b-35cfa13722f8', '<p><strong class="ql-size-large">현재 전국의 천문대 수가 70~80개 소에 이른다는 걸 알고계신가요?</strong></p><p><br></p><blockquote>저는 별을 좋아하지만 도시에 살아 별을 잘 볼 수 없었던 것이 늘 아쉬웠어요.</blockquote><p><br></p><blockquote>조금만 외곽으로 나가면 밤하늘의 은하수를 두 눈 가득 담을 수 있다니, 정말 멋진 일 아닌가요?</blockquote><p><br></p><p>저와 같이 별을 좋아하는 취미를 가진 누군가를 위해, 별을 가장 밝고 시원하게 볼 수 있는 명소를 소개합니다.</p><p><br></p><p>1단계에서는 우선 특별한 장비없이도 별을 잘 찍을 수 있는 방법에 대해 알아보고, 차근차근 가까운 지역부터 별을 만나러 가봅시다.</p>', '별을 좋아하지만 별과 관련된 취미를 어떻게 시작해야할지 막막하셨나요?\n그런 분들을 위해 은하수 명소를 방문할 수 있는 챌린지를 마련하였습니다.', 1, 3, '전국의 밤하늘 명소를 정복해보자.', 1, 18),
	(12, '2022-08-17 04:17:59.639206', '2022-08-18 15:26:49', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F12?alt=media&token=0dddb098-6d75-449b-8354-a6d2b276321b', '<p><strong class="ql-size-large">혹시 양쯔강에 고래가 존재했다는 이야기 들어보신 적 있나요?</strong></p><p><br></p><blockquote>고래는 실로 놀라운 동물입니다.</blockquote><blockquote>바다에 살지만 새끼를 낳는 포유류이면서 극지방부터 민물까지 존재하지 않은 곳이 없습니다.</blockquote><blockquote>많은 고래들이 행복한 자신의 삶을 살 수 있도록 고래를 좋아하는 사람들을 위한 공부 취미 챌린지를 기획해 보았습니다 ~ 🐳</blockquote>', '깊은 심해에는 130만 마리의 다양한 고래가 살고 있습니다.\n우리와 친숙한 돌고래부터, 저 먼 극지방에 사는 고래까지.\n고래가 존재하지 않는 바다는 없습니다. 고래에 대해 저와 함께 공부해보지 않으실래요?', 1, 6, '고래에 관해 A 부터 Z 까지 알기', 1, 18),
	(13, '2022-08-17 08:25:17.149402', '2022-08-17 15:42:36', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F13?alt=media&token=3279652c-8520-4369-87ed-644b45ae26fd', '<p><strong class="ql-size-large">쉽고 재미있게 읽히는 책을 고르고 골라 챌린지로 기획하였습니다.</strong></p><p><br></p><blockquote>민음사 세계 문학 전집의 대표 작품들을 소개합니다.</blockquote><blockquote>이 번 챌린지를 기획하며 저는 제 사심을 아주 듬뿍 담았습니다.</blockquote><blockquote>한 권 한 권 읽으며 자신에게 인상 깊었던 문구를 공유해 봅시다 ☺</blockquote><blockquote>포스팅을 업로드 하면 많은 유저들과 더욱 더 풍성한 이야기를 나누실 수 있어요!~ 😎</blockquote>', '세계 문학 전집의 압도적 양에 매 번 좌절했던 경험이 있나요? 😥\n세계 문학 전집 중에서도 쉽게 문학에 다가갈 수 있는 알짜만 쏙 뽑아 챌린지를 기획하였습니다. 🥰\nLet\'s go! 함께 도전해 봅시다! 🐾', 2, 4, '세계문학에 한 발 더 가까워 지기', 1, 17),
	(14, '2022-08-17 09:54:00.034940', '2022-08-17 11:29:33', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F14?alt=media&token=a8f7d394-b8e8-480a-b3ab-91281bb770cf', '<p><strong class="ql-size-large">식물을 키우고 싶지만, 어떤 식물부터 시작해야할지 고민이셨나요?</strong></p><p><br></p><p>우리는 상추부터 차근차근 키워보기로 했습니다.</p><p><br></p><p>하나 둘 식물을 성장시키다 보면, 보람과 함께 어느새 식집사로 성장한 스스로를 발견할 수 있을거에요!</p>', '식물을 키우고 싶지만, 어떤 식물부터 시작해야할지 고민이셨나요? 상추부터 차근차근 식물을 키워봅시다! \n스테이지를 한스텝씩 성공하다보면, 미래의 식집사 머지않았습니다~🍀', 2, 1, '나도 미래의 식집사 🌱', 1, 17),
	(15, '2022-08-17 10:46:22.910039', '2022-08-17 16:11:01', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F15?alt=media&token=f3a734b0-8ed6-4fe1-ab68-c5ab9c6950d4', '<p><strong class="ql-size-large">오기가미 나오코의 작품 중 가장 유명한 영화를 꼽으라면 카모메 식당을 빼놓을 수 없습니다.</strong></p><p><strong class="ql-size-large">﻿</strong></p><p><span class="ql-size-large">그녀의 영화는 마블 영화와 같은 화려함은 없지만 잔잔한 여운을 오랫동안 남깁니다.</span></p><p><br></p><p><span class="ql-size-large">﻿바쁜 삶에 지쳐 여유로움을 느끼고 싶다면 주말마다 한 편씩 감상해보는 건 어떠세요?</span></p><p><br></p><p><span class="ql-size-large">이게 뭐지? 하면서 슬며시 다른 작품을 찾아보고 있는 자신을 발견할지도 몰라요~😉</span></p>', '일본의 감독, 오기가미 나오코를 아시나요? 영화는 느리고 단조로워 보이지만, 따뜻함과 포근함이 가득합니다.\n영화를 좋아하지만 색다른 취향을 즐기고 싶다면 그녀의 영화가 좋은 선택지가 될 것입니다.', 2, 4, '오기가미 나오코의 힐링 영화 3편🎞', 1, 16),
	(16, '2022-08-17 11:06:43.584038', '2022-08-17 13:45:59', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F16?alt=media&token=f67e84fb-8464-4086-b71a-ee61f52a1f61', '<p>사람들을은 항상 무언가를 보고 있습니다. 시대에 따라 그 대상이 변하기는 했지만 사람들은 항상 무언가를 보고 있어요.</p><p><br></p><p>무엇을 보는지는 제각각 다르지만 요즘 시대에는 보편적으로 스마트폰이라고 볼 수 있죠. 가만히 서서, 걸으면서, 누워서 스마트폰을 보고 있습니다.</p><p><br></p><p>사실 그들은 단순히 보는 것 이상의 활동을 하고 있어요. 정보를 받아들이고 있다는 말입니다. </p><p><br></p><p>얼핏 보면 책을 보는 것과 다를 바 없다고 생각할 수도 있습니다. 하지만 전 그렇게 생각하진 않아요.</p><p><br></p><p>스마트폰에 담겨져 있는 수많은 정보 매체들은 극한의 편의성을 추구합니다. 사용자들이 이해하기 쉽게, 또는 그렇게 느끼게끔 온갖 작전들이 다 들어가 있죠.</p><p><br></p><p>부담되지 않게 정보 습득에 걸리는 시간을 줄이고, 강조할 것은 강조하고 어떤 사실은 부풀리기도 하며 이른바 가독성, 또는 확 와닿는 느낌을 주기 위해 아주 잘 만들어진 무언가죠.</p><p><br></p><p>하지만 책은 어떤가요? 책은 그렇지 않습니다. 기껏해봣자 강조 문구나 글씨체 변환 등이 다죠. 책에서는 저 스스로가 문맥을 짚고 찾아야 합니다.</p><p><br></p><p>그 어떤 작가도 책을 쓰며 독자가 어느 한쪽으로만 기울어지길 원하진 않을 겁니다. 정보의 바다에 떠다니는 그 정보들과 가장 큰 차이점이죠.</p><p><br></p><p>그렇기 때문에 책을 읽어야 합니다. 만들어진 몰입은 당신에게 그저 몰입하는 느낌만 줄 겁니다.</p>', '책을 읽는다는 것, 취미로 한번 길들어볼까요?', 2, 2, '책을 읽는다는 것, 몰입의 순간', 1, 11),
	(17, '2022-08-17 11:54:48.406484', '2022-08-17 13:26:09', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F17?alt=media&token=1e2c1b43-6147-4cc8-addb-aa4c20a7fc90', '<p><strong class="ql-size-large">혼밥메이트로 드라마만한 것이 없죠?</strong></p><p><br></p><p><span class="ql-size-large">노희경 작가님의 작품은 시간 순삭, 가벼운 마음으로 즐길 수 있습니다.</span></p><p><br></p><ul><li><span class="ql-size-large">사람 냄새가 물씬 풍기는 드라마를 찾고 있다면? </span></li></ul><p><br></p><ul><li><span class="ql-size-large">심각한 내용이 아닌 일상 생활의 이야기로 매일매일을 채우고 싶다면?</span></li></ul><p><br></p><p><span class="ql-size-large">위 두 사항에 해당하시는 분은 챌린지 꼭 도전하셔야 합니다! 😉</span></p>', '\'우리들의 블루스\'를 즐겨보셨나요? 비슷한 취향의 작품을 더 즐겨보고 싶진 않나요?\n노희경 작가님의 찐 팬으로서 작가님의 드라마를 더욱 풍성하게 즐길 수 있도록 챌린지를 구성해보았습니다! \n', 2, 3, '시간 순삭, 믿보 드라마!', 1, 16),
	(18, '2022-08-17 13:21:04.113913', '2022-08-17 14:10:54', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F18?alt=media&token=75ddc788-239b-4ef7-81fe-a9640ba83aa2', '<p>철학은 무엇일까요? 나와 타인, 그리고 세상 이 셋의 상호작용 이걸 생각해보는 게 바로 철학입니다.</p>', '철학에 입문하고자 하는 이들에게 던지는 가벼운 화두 7개! ', 2, 0, '어렵지 않은 철학! 이렇게 쉽다고?', 1, 11),
	(19, '2022-08-17 14:00:27.722537', '2022-08-17 16:10:11', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F19?alt=media&token=7134eb09-7731-499f-953a-37281cd21b1a', '<p><strong class="ql-size-huge">한 청년이 숲속 깊은 곳에 사는 드루이드를 찾아왔다. </strong></p><p><br></p><p><span class="ql-size-large">“저도 드루이드가 되고 싶습니다!”</span></p><p><br></p><p><span class="ql-size-large">“자네. 설마 정말로 드루이드가 되고 싶은 것인가??”</span></p><p><br></p><p><span class="ql-size-large">“네! 여길 오면 ‘드루이드의 길’을 알려주신다고 해서요.”</span></p><p><br></p><p><span class="ql-size-large">"사실 드루이드가 되는 것은 어렵지 않다네.. 한번 알려주는 대로 따라와 보게나.."</span></p><p><br></p><p><br></p><p><strong class="ql-size-huge"><u>스테이지 구성</u></strong></p><p><br></p><p><strong class="ql-size-large">🪴 1. 화분 준비하기</strong></p><p><br></p><p><span class="ql-size-large">🥔 </span><strong class="ql-size-large">2. 고구마 키우기</strong></p><p><br></p><p><strong class="ql-size-large">🍅 3. 토마토 키우기</strong></p><p><br></p><p><strong class="ql-size-large">🍉 4. 제철 과일 키우기</strong></p><p><br></p><p><strong class="ql-size-large">🏞️ 5. (자율) 자연 느껴보기</strong></p><p><br></p><p><br></p><p><br></p>', '우리 주변에 항상 함께하는 여러 식물들! 보기만하고 키워보신적은 있으신가요? \n식물 키우기 어렵지 않아요! \n한번 도전해보는건 어떨까요?', 2, 2, '드루이드 퀘스트 🌱🌿', 1, 15),
	(20, '2022-08-17 14:05:59.593667', '2022-08-17 17:31:10', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F20?alt=media&token=1cd66c1e-a494-441f-a2cf-de4d10450267', '<p><span class="ql-size-large">낭만주의, 인상파, 초현실주의 등등 시대를 일컫는 특징적 용어가 있죠.</span></p><p><span class="ql-size-large">하지만 현대 미술은 그 경계가 모호합니다.</span></p><p><span class="ql-size-large">뚜렷한 특징을 지을 수 없다는 뜻인데요~</span></p><p><span class="ql-size-large">어떻게 즐겨야할지 방법을 잘 몰라 미술관을 가기 두렵지 않으셨나요?</span></p><p><span class="ql-size-large">한국의 화가들과 친숙해지면서 현대미술에 한 발자국 더 가까워지세요~</span></p><p><br></p><p><strong class="ql-size-large">예술은 무엇을 많이 아는것이 아니라 어떻게 즐길 수 있는지 방법을 터득하는 것입니다. 🥰</strong></p>', '낭만주의, 인상파, 초현실주의 등등 시대를 일컫는 특징적 용어가 있죠~\n하지만 현대 미술은 그 경계가 모호합니다.\n미술을 알고싶지만 어떻게 즐겨야할지 몰랐던 당신을 위해 준비한 챌린지 입니다 😎', 3, 2, '현대 미술에 한 발자국 가까워져보자!', 1, 20),
	(21, '2022-08-17 14:18:24.862767', '2022-08-17 14:25:32', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F21?alt=media&token=cafbaf9b-cd2c-4861-aebf-852cd1840ec4', '<p>배그할사람 구합니다 연락주세요</p>', '배그할사람 치킨 먹여드려요', 1, 1, '배그할사람 구해요', 0, 5),
	(23, '2022-08-17 15:03:47.877374', '2022-08-17 16:16:37', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F23?alt=media&token=928b1f3b-b75d-4815-bfbd-12621494fa8d', '<p>저는 클래식에 대해 잘 알지는 못하지만, 제가 클래식을 시작하는데 큰 영향을 미친 피아니스트들이 있습니다.</p><p><br></p><p>바흐를 즐기기 시작하게 된 것은 지용의 골든베르크 변주곡 앨범 덕분입니다.</p><p><br></p><p>조성진의 드뷔시 앨범은 찬란하다는 느낌을 들게 한다면, 임윤찬의 라흐마니노프는 경이로움에 빠지게 합니다.</p><p><br></p><p>협주곡 몇 번, 어떤 악장의 이름을 아는 것이 중요한 것이 아닙니다.</p><p><br></p><p><strong>자신의 취향에 맞는 음악, 귀를 즐겁게 하는 음악 이번 기회에 같이 찾아보는 건 어떨까요? 🎹</strong></p>', '최근 반 클라이번 콩쿠르에서 임윤찬 피아니스트가 우승을 하며 큰 화제가 되었는데요.\n클래식에 관한 관심도 함께 높아졌지만, 클래식은 너무 방대하고 어렵습니다.\n한국의 피아니스트들과 함께 클래식에 가까워져보세요!', 2, 2, '한국의 피아니스트', 1, 20),
	(27, '2022-08-17 16:33:23.127884', '2022-08-18 11:45:31', '', '<p><strong class="ql-size-huge">피그마라는 툴을 이용해,</strong></p><p><strong class="ql-size-huge">간단한 일러스트를 따라 그려봅시다.!</strong></p><p><br></p><p><br></p><p><span class="ql-size-large">물론 피그마가 아니어도 좋아요! 곡</span></p><p><br></p><p><span class="ql-size-large">선을 드래그로 그릴 수 있는 모든 툴이면 가능합니다.</span></p><p><br></p><p><span class="ql-size-large">예를 들면 포토샵이나, 파워포인트 같은 것이라도요!</span></p>', '간단한 일러스트를 그려보아요', 1, 0, '피그마로 일러스트 그려보기! 🖼️', 0, 15),
	(28, '2022-08-17 17:10:55.736059', '2022-08-17 17:13:02', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F28?alt=media&token=da1de072-58d5-4e46-8b6c-618475aea68d', '<p>기본 웹 프로젝트를 생성하고 배포까지 해봅시다!</p>', '웹 제작을 해봅시다!', 3, 1, '웹 제작을 제작하고 배포해봅시다!', 1, 17),
	(29, '2022-08-18 10:07:42.972487', '2022-08-18 10:07:44', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F29?alt=media&token=e8fc970d-8de2-42db-94f7-73279340e3dd', '<p>시연용</p>', '시연용', 1, 0, '시연용', 0, 11),
	(31, '2022-08-18 15:31:30.544448', '2022-08-18 15:31:31', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F31?alt=media&token=bd973bb5-e6a1-4698-b513-41207ee9d87f', '<p><span class="ql-size-huge">한국의 여러 명산에 대해 알아보고!</span></p><p><br></p><p><span class="ql-size-huge">직접 한번 다녀와 보자!</span></p>', '한국의 명산을 다녀보자!', 2, 0, '한국의 명산 등반 챌린지😎', 0, 30),
	(32, '2022-08-18 23:56:47.099976', '2022-08-19 01:17:03', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F32?alt=media&token=fd6da3b8-a504-455e-87b2-a6c06262716a', '<blockquote>여름은 밤하늘을 관찰하기 정말 좋은 계절이죠!</blockquote><blockquote><br></blockquote><blockquote>도시의 열대야가 우리를 괴롭힌다면 주위 공기가 맑고 불빛이 적은 곳으로 짧은 여행을 떠나보는건 어떨까요?</blockquote><blockquote><br></blockquote><blockquote>대청마루에 누워 밤하늘을 바라보면 쏟아질 것 같은 별들에 눈을 뗄 수 없습니다.</blockquote><blockquote><br></blockquote><blockquote>이 기회에 별자리를 찾는 취미를 가져보는 건 어떠세요?</blockquote><blockquote><br></blockquote><blockquote>별들의 이야기가 궁금한 당신을 위해 여름을 알리는 별자리들을 소개합니다.</blockquote>', '취미 화려할 것 있나요? 자신을 행복하게 만드는 그 무언가! 그것이 취미가 됩니다.\n이번 챌린지에서 여름 밤하늘에서 만날 수 있는 별자리에 대해 소개합니다. \n무한한 밤하늘의 숨은 이야기 같이 알아보아요!', 1, 1, '여름을 알리는 별자리들', 1, 18),
	(33, '2022-08-19 00:03:03.641086', '2022-08-19 00:03:04', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F33?alt=media&token=7a7a2a3f-c871-4c71-b589-0867d58a2c5c', '<p>123</p>', '123', 1, 0, '123', 0, 15),
	(34, '2022-08-19 00:05:40.331163', '2022-08-19 00:05:41', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F34?alt=media&token=4bf79db6-f207-4816-92c5-d2399d8d325a', '<p>111</p>', 'test', 2, 0, '111', 0, 15),
	(35, '2022-08-19 00:06:37.570471', '2022-08-19 00:06:38', 'https://firebasestorage.googleapis.com/v0/b/moggozi-2be28.appspot.com/o/challenge%2F35?alt=media&token=bb370cc1-4381-401b-98a8-e8ca2b8ae6e5', '<p>test</p>', 'test', 1, 0, 'test', 0, 15),
