INSERT INTO `notice` (`notice_id`, `created_date`, `modified_date`, `content`, `title`) VALUES
	(1, '2022-08-17 12:28:18.744900', '2022-08-17 12:38:18.198144', '모꼬지 서비스를 잘 이용하고 계신가요? \r\n사용법을 익히고 싶으시다면 메인에서 \'모꼬지는 어떻게 사용해아할까요?\'라는 배너를 눌러주세요! \r\n모꼬지 팀은 여러분들이 편리한 서비스를 이용할 수 있도록 항상 노력하고 있습니다. \r\n그럼 오늘 하루도 화이팅! 🤗 ', '모꼬지 사용법이 궁금하다면 메인페이지에서 관련 배너를 클릭해보세요~ 😉'),
	(2, '2022-08-17 12:57:46.000000', '2022-08-17 12:57:49.000000', '안녕하세요. 당신을 위한 취미공유 SNS 모꼬지입니다. \r\n취미공유 SNS 모꼬지가 사전오픈함에 따라 설문조사 이벤트가 진행됩니다.\r\n추첨을 통해 *스타벅스 아메리카노 Tall 기프티콘*을 전달드릴 예정이니많은 참여 바랍니다.\r\n이벤트의 참여는 다음 설문조사 링크에서 확인하실 수 있습니다. \r\n(🔗https://forms.gle/YsrpxDNKo9ZiYbmH9)\r\n감사합니다.', '[이벤트] 모꼬지 오픈기념 설문조사 이벤트🎉');
INSERT INTO `post` (`post_id`, `created_date`, `modified_date`, `content`, `like_num`, `state`, `title`, `member_id`, `stage_id`) VALUES
	(1, '2022-08-16 22:39:22.587918', '2022-08-17 10:07:22.460483', '<p>격한 운동을 하기전 스트레칭은 운동효율을 50%이상 향상시켜줍니다.</p><p>오늘 할 운동을 미리 생각해보고 해당 부위를 위주로 스트레칭을 진행해주세요.</p>', 0, 0, '첫 포스팅입니다', 8, 1),
	(2, '2022-08-17 00:18:28.748655', '2022-08-17 02:09:00.109070', '<p>불완전함 인물들에게 위로받았다.</p><p>노르웨이 숲이란 제목은 탁월하다. </p><p>하나의 시대를 감싸고 있던 공기를 그려보고 싶다 했던 하루키의 말처럼노르웨이 숲의 공기가 내 주위를 감쌌다.</p><p>끝내 불완전한 삶을 버텨내지 못하고 세상을 떠난 이도 있었지만, </p><p>난 남자주인공이 불완전한 사람들과 살아가기로 마음먹은 장면이 좋았다.</p><p>마치 내가 스스로에게 하는 다짐같았다. </p><p><br></p><p><br></p>', 2, 0, '노르웨이 숲 - 불완전함의 매력', 13, 6),
	(5, '2022-08-17 01:13:25.809406', '2022-08-17 14:19:42.818740', '<p>오늘도 나는..</p><p>내 부족함...열등감..시기..질투.. 모든 부정적감정을..</p><p>이 바닥에 놓고 들어올린다...</p><p>후... 이렇게 더 나은 사람이 된다...</p>', 0, 0, '하나둘 셋 하면 뽑으시는거에요', 8, 4),
	(6, '2022-08-17 01:46:45.865918', '2022-08-17 14:15:38.894030', '<p>나를 죽이지 못하는 고통은 나를 더 강하게 만든다...</p><p>벤치프레스를 시작하고 라운드 숄더가 나아지고 가슴을 당당히 펴고 다닐수 있게되었다.</p><p><br></p>', 0, 0, '으라차차 벤츠프레스 오백키로!!!', 8, 2),
	(7, '2022-08-17 02:03:04.880464', '2022-08-17 10:08:44.783917', '<p>웨이트 트레이닝의 a to z 스쿼트</p><p>벤치프레스는 모르겠지만, 스쿼트를 하면서 건강이 많이 좋아짐을 느낀다.</p><p>아프던 허리가 이젠 아프지않고, 몸에 근육량도 많이 늘었다.</p><p>스쿼트하세요 두번하세요</p>', 0, 0, '셧업 앤 스쿼트', 8, 3),
	(8, '2022-08-17 02:06:20.573772', '2022-08-17 14:20:33.993933', '<p>제일 하기싫어 힘든 운동 흑흑...</p><p>도대체 유산소는 왜 해도해도 좋아지지도 않고,</p><p>늘지도 않는지 모르겠다.</p><p>유산소를 게을리한 탓일까.. 몸이 서는데 무리는 없지만, 오래동안 버티는건 그대로 인 느낌이다.</p>', 0, 0, '가장 가치있지만', 8, 5),
	(9, '2022-08-17 03:46:24.274578', '2022-08-17 16:11:45.243287', '<p>다양한 장소에 걸쳐 오랜 시간 꼼꼼히 읽었어요.</p><p>소설 속 많은 인물들이 죽음을 맞이했다는 점이 가슴아팠습니다.</p><p>와타나베가 수 많은 상실을 겪고 어딘지 모를 곳으로 방황하며 끝난 것이 더욱 여운을 오래 남게 했습니다.</p>', 4, 0, '노르웨이 숲 - # 시간 순삭', 18, 6),
	(10, '2022-08-17 03:50:14.426605', '2022-08-17 16:11:42.094582', '<blockquote>설사 그렇다 하더라도,</blockquote><blockquote>즉 네 선택이나 노력이 헛수고로 끝나도록</blockquote><blockquote>운명 지어져 있다 하더라도,</blockquote><blockquote>그래도 너는 조금도 어김없는 너인 거고,</blockquote><blockquote>너 이외의 아무도 아닌 거야.</blockquote><blockquote>너는 너로서 틀림없이 앞으로 전진하고 있어.</blockquote><blockquote>걱정하지 않아도 돼.</blockquote>', 5, 0, '해변의 카프카 - 인상깊었던 문장', 18, 7),
	(11, '2022-08-17 03:58:48.036222', '2022-08-18 11:53:23.863729', '<p>책이 조금 길어 소화하는데 오랜시간이 걸렸습니다.</p><p>제가 좋아하는 카페에 가서 시원한 아메리카노와 함께 기사단장 죽이기를 드디어 끝냈습니다! 🤗🎈</p><p><br></p><p><img src="data:image/png;base64,"></p>', 4, 0, '기사단장 죽이기 - 드디어 완독!', 18, 9),
	(13, '2022-08-17 09:39:06.849108', '2022-08-17 09:40:12.315654', '<p>마지막 수족관 남방큰돌고래 \'비봉이\'가 곧 제주 바다로 돌아간다고 하네요!</p><p>바다에서의 삶은 보다 자유로웠으면 합니다!</p>', 1, 0, '제주바다의 품으로!', 17, 43),
	(14, '2022-08-17 09:44:02.793541', '2022-08-17 09:44:28.744973', '<p>향고래가 동해 바다에 나타났다는 소식 들으셨나요?</p><p>향고래를 공부하며 안 사실인데, 거대한 몸 크기 뿐 아니라 향고래는 가장 큰 뇌를 가진 동물이라고 해요!</p><p>활동 반경이 워낙 넓어서 동해에 서식하는 것은 아니지만 운이 좋으면 우리도 볼 수 있지 않을까요? 💙</p>', 1, 0, '동해 바다에 향고래 나타나다!', 17, 44),
	(15, '2022-08-17 11:14:47.022688', '2022-08-17 11:15:20.392471', '<p>완벽하게 성공은 하지 못했지만, 휴대폰으로 이정도의 퀄리티라면 만족합니다! 😸</p>', 1, 0, '밤하늘 별 찍기!', 16, 39),
	(16, '2022-08-17 11:17:39.146404', '2022-08-17 11:18:28.156792', '<p>생각보다 사람들이 많아 놀랐어요~ 🙄</p><p>모두 플래시를 끄고 사진을 찍고 있었지만,</p><p>조용한 것을 좋아하는 저에게는 다소 기대에 못미치는 장소였습니다.</p><p>그렇지만 밤하늘은 너무 예뻤어요! ✨</p>', 1, 0, '양평 벗고개 방문!', 16, 40),
	(17, '2022-08-17 11:26:07.532715', '2022-08-17 16:57:01.839441', '<p>범고래는 지능이 높기 때문에 수족관에서 많은 스트레스를 받습니다.</p><p>그러나 바다의 범고래들은 아주 자유롭게 헤엄치는 모습을 볼 수 있는데요~</p><p>범고래의 아기들은 폴짝 폴짝 점프하기를 즐깁니다.</p><p>위로 높이 점프 점프 하는 모습이 너무 행복해보이네요~</p>', 2, 0, '아기 범고래의 폴짝! 귀여워 🥰', 16, 46),
	(18, '2022-08-17 13:25:13.738882', '2022-08-17 17:08:05.858417', '<p>캘리그라피에 도전해보았습니다. </p><p>글씨 예쁘게 쓰기란 정말 만만치 않군요 😯 </p><p>꾸준히 해서 더 실력을 증진시키고 싶어요~</p>', 3, 0, 'Just be yourself', 18, 23),
	(19, '2022-08-17 14:31:13.562423', '2022-08-18 23:00:17.673337', '<p>거의 처음으로 제대로 읽어본 일본 문학.</p><p>그 시작이 하필 거장의 것이라 왠지 앞으로의 것들은 한참이나 기대치에 못 미칠 것 같기도 하지만...</p><p>그 내용보다도 그림과도 같은 표현력에 감탄을 했던 책이었다.</p>', 1, 0, '군대에서 읽었던.. 노르웨이 숲', 11, 6),
	(20, '2022-08-17 14:33:00.939136', '2022-08-18 23:00:19.509224', '<p>언젠가 인간이 고래와 친구가 되는 날도 있겠죠? 이를테면... 바다개?</p>', 2, 0, '고래와 친구가 되고 싶다. ', 11, 43),
	(21, '2022-08-17 15:09:12.770280', '2022-08-17 15:09:12.770280', '<p>무라카미 하루키의 소설은 참 맛드러진 듯하다. 담고있는 메세지 주제를 떠나. 문체가 상당히 읽기에 맛있다.</p><p>누구나 방황하던 기억을 가지고 있고, 그때의 우리의 선택은 나쁘지않았다.. 다 읽고 나서 매우 먹먹하면서 밝은 기분이 든, 오묘한 경험을 담은 책이다.</p>', 0, 0, '우린 지금 상실의 시대에 살고 있다..', 8, 6),
	(24, '2022-08-17 15:19:22.063999', '2022-08-17 15:19:34.574489', '<p>많이 추천을 하는 제노 붓펜을 구매했습니다~</p><p>벌써 설레기 시작했어요! ㅎㅎ</p>', 1, 0, '붓펜 구매하기', 1, 19),
	(25, '2022-08-17 15:23:19.806766', '2022-08-17 15:23:19.806766', '<p>붓펜에 좀 더 익숙해져 가는 기분이에요!</p><p>어떻게 하냐에 따라 다르다니...</p><p>쉽지 않지만 그래도 신기하고 재밌었습니다!!</p>', 0, 0, '선 연습을 했습니다', 1, 20),
	(26, '2022-08-17 15:23:44.901493', '2022-08-18 23:00:15.239490', '<p>근데 솔직히 내용은 이해가 안 갔어요 ㅋㅋㅋ </p>', 1, 0, '이 책 또한 군대에서 읽었는데...', 11, 49),
	(27, '2022-08-17 15:24:48.163569', '2022-08-18 23:00:13.257851', '<p>철학 교수님이 요즘 같은 시대에 이방인이 필요하다 해서 읽어봤는데...</p><p>제 머리가 돌인지 잘 이해가 안 갔어요.</p>', 1, 0, '보고 나서 멍했던 기억이....', 11, 51),
	(28, '2022-08-17 15:24:49.282538', '2022-08-17 15:24:58.209911', '<p>사진 찍는게 만만치 않더군요.</p><p>휴대폰으로는 한계가 있는 것 같아요.</p><p>카메라가 있다면 더 멋진 사진을 담을 수 있을 것 같습니다!</p>', 1, 0, '평창 육백마지기 넘나 좋았어용!', 20, 42),
	(29, '2022-08-17 15:34:26.863973', '2022-08-17 15:34:26.863973', '<p>나만의 글씨를 찾아보는 시간이었다.</p><p>많은 연습이 필요하지만 달라진 글씨를 보면 또 뿌듯해진다! ㅎㅎ</p>', 0, 0, '모음 자음 연습하기!', 1, 21),
	(36, '2022-08-17 15:50:08.724194', '2022-08-17 17:37:29.144169', '<p>식물은 키워본적 없지만 한번 시작해보려고 합니다!</p><p><br></p><p>잘 할수 있을지 의문이지만 </p><p><br></p><p>일단 해보는거죠 ㅋㅋ</p>', 1, 0, '저도 시작해보려구요! 드루이드 퀘스트!', 15, 82),
	(37, '2022-08-17 15:50:29.232843', '2022-08-17 17:38:03.877762', '<p>캘리그라피를 하면 보기 좋은 긍정의 단어를 생각하고 연습하고 쓰게 됩니다.</p><p>캘리그라피를 통해서 조금은 즐거운 삶으로 변하게 되는게 아닐까요?</p><p>글씨를 통해서 힐링도 했습니다!</p>', 1, 0, '긍정의 낱말 적기', 1, 22),
	(38, '2022-08-17 15:51:21.358047', '2022-08-17 17:35:41.964586', '<p>어느새 토마토가 이렇게 무럭무럭 자랐습니다.</p><p><br></p><p>시작한지 얼마 안된 것 같은데 정말 빠르네요!</p><p><br></p><p>이대로 점점 큰것도 키워보고 싶더라구요 ㅋㅋ</p>', 2, 0, '토마토는 거꾸로해도 토마토', 15, 85),
	(39, '2022-08-17 15:53:07.508196', '2022-08-17 17:43:41.172215', '<p>많이 발전된 모습입니다 ㅎㅎ</p><p>불가능이라고 여긴 글씨가 이렇게...</p><p>할수 있다 하면 된다</p>', 1, 0, '문장으로 써보기', 1, 23),
	(40, '2022-08-17 15:54:55.081691', '2022-08-17 17:38:27.714325', '<p>오늘 하루도 수고했습니다~ ㅎㅎ</p>', 1, 0, '책갈피도 만들어 봤습니다!', 1, 24),
	(41, '2022-08-17 15:58:23.623819', '2022-08-17 15:58:23.623819', '<p>굵은 펜으로 연습했습니다.</p><p>굵은 펜은 또 다른 시작이네요 ㅎㅎ</p>', 0, 0, '굵은 펜은 또 다른 시작이네요', 1, 25),
	(42, '2022-08-17 16:00:39.803773', '2022-08-18 10:24:03.623962', '<p>캘리그라피는 어렵지 않습니다</p><p>ㅎㅎ 모두 잘 할 수 있습니다!</p>', 1, 0, '캘리그라피는 어렵지 않습니다', 1, 26),
	(43, '2022-08-17 16:09:54.170738', '2022-08-17 16:09:54.170738', '<p>원형 스티커를 만들어 봤습니다!</p><p>종이에 쓰는 것과는 또 다른 느낌이네요 ㅎㅎ</p>', 0, 0, '감사합니다', 1, 27),
	(44, '2022-08-17 16:13:24.387719', '2022-08-17 17:38:01.210795', '<p>저도 이런 글씨를 가지고 작품처럼 느껴지게 되다니...</p><p>신기하네요 볼 때마다 뿌듯하네요 ㅎㅎ</p>', 1, 0, '긴 문장으로 작품을 만들었습니다', 1, 28),
	(45, '2022-08-17 16:14:58.072389', '2022-08-17 19:30:13.271269', '<p>지금이 적기이다 싶어서 바로</p><p><br></p><p>마트 달려가서 용기 산 다음에</p><p><br></p><p>소분 딱 하고 냉장고에 넣어놨습니다!</p><p><br></p><p>아직 음식은 안했지만 마음이 든든하네요!</p>', 2, 0, '바로 마트 달려서 소분 탁탁!', 22, 31),
	(46, '2022-08-17 16:18:21.627631', '2022-08-18 10:23:54.932379', '<p>정말 누구에게 선물하기도 좋은 캘리엽서를 저도 직접 만들어 봤습니다 ㅎㅎ</p><p>주변에 마음 편하게 선물하기 좋은거 같아요</p>', 1, 0, '캘리엽서를 만들었습니다', 1, 29),
	(47, '2022-08-17 16:18:55.483513', '2022-08-17 19:30:08.770352', '<p>포터블 스피커와 함께라면 어디든지</p><p><br></p><p>지용과 함께할 수 있어요!</p><p><br></p><p>언제나 귀가 즐겁네요 다른 분들도 꼭 들어보셨으면</p><p><br></p><p>좋겠습니다. 정말 좋은 챌린지에요 </p>', 2, 0, '이곳저곳 돌아다니며 스피커로 듣고 있습니다!', 22, 89),
	(48, '2022-08-17 16:56:16.808578', '2022-08-17 16:56:36.032168', '<p>벨루가 하얘서 너무 예쁘지 않나요?</p>', 1, 0, '벨루가 예뻐요', 17, 45),
	(49, '2022-08-17 16:57:40.709093', '2022-08-17 19:30:02.518568', '<p>범고래 너무 모양이 멋있지않나요?</p>', 2, 0, '범고래 멋쟁이!', 17, 46),
	(50, '2022-08-17 17:19:13.924555', '2022-08-17 17:19:25.004143', '<p>기교가 현란하네요. 이번 생에 그의 곡을 들을 수 있다니! 행운입니다!</p>', 1, 0, '현란한 기교에 놀라다', 26, 91),
	(51, '2022-08-17 17:36:05.941747', '2022-08-17 17:36:05.941747', '<p>기분이 안좋을 때면 초록초록한 자연이 저를 위로해줍니다. 자연 느끼기! 모두에게 추천합니다.</p>', 0, 0, '자연느끼기 성공', 26, 87),
	(52, '2022-08-17 17:37:18.677874', '2022-08-17 17:37:18.677874', '<p>이 화분엔 어떤 식물의 새싹이 피어날까요? 제가 한 번 도전해보겠습니다!</p>', 0, 0, '시작이 반!', 26, 82),
	(53, '2022-08-17 17:47:26.721167', '2022-08-17 17:47:26.721167', '<p>최애! 너무 좋았어요! </p>', 0, 0, '최애!', 26, 67),
	(54, '2022-08-17 17:48:49.185969', '2022-08-18 09:12:57.900653', '<p>조인성만 보였다...</p>', 1, 0, '장재열... 마지막회에 펑펑 ㅠㅠ ', 26, 68),
	(55, '2022-08-17 17:51:20.764729', '2022-08-18 09:12:40.452378', '<p>저도 나이들면 이런 친구들과 함께했으면 좋겠어요!</p>', 1, 0, '너무 예뻤던 드라마', 26, 69),
	(56, '2022-08-17 17:52:48.720196', '2022-08-17 19:29:56.190550', '<p>2편이 제발 나왔으면 좋겠다 🥺</p>', 1, 0, '이거 2편은 안나오나요...?', 26, 70),
	(58, '2022-08-18 14:59:26.618580', '2022-08-18 14:59:26.618580', '<p>정말 재미있는 책이었어요!</p><p><br></p><p><span class="ql-size-large">다음에는 꼭 친구와 함께 이 책에 이야기해보고 싶습니다!</span></p>', 0, 0, '저도 책 읽기 참여합니다.!!!', 30, 6),
	(59, '2022-08-18 15:25:11.315863', '2022-08-18 15:25:11.315863', '<p>정말 재미있는 책이었습니다.!</p><p><br></p><p>3권이 없는게 정말 아쉬울 따름..</p>', 0, 0, '저도 이번 기회에 읽게 되었어요!', 30, 7);
