INSERT INTO `review` (`id`, `created_date`, `modified_date`, `rate`, `review_content`, `challenge_id`, `user_id`) VALUES
	(1, '2022-08-16 23:47:57.768515', '2022-08-16 23:47:57.768515', 5, '고슴도치를 사랑하는 당신! 오늘의 운세는.... 두구두구두구', 5, 11),
	(3, '2022-08-17 00:01:01.190331', '2022-08-17 00:01:01.190331', 5, '그동안 소설 읽기 미루기만 했었는데 이번 기회를 통해 무라카미 팬이 됐어요! 취미챌린지 짱! 🥰', 1, 13),
	(4, '2022-08-17 00:52:35.251369', '2022-08-17 00:52:35.251369', 5, '내가 만든 거지만... 진짜 코테 공부 순서에 딱 알맞다! ', 6, 11),
	(5, '2022-08-17 00:53:24.549768', '2022-08-17 00:53:24.549768', 5, '3대 몇이세호?', 2, 11),
	(6, '2022-08-17 01:42:23.866321', '2022-08-17 01:42:23.866321', 5, '도전할래요!!!!', 6, 14),
	(7, '2022-08-17 05:01:00.520707', '2022-08-17 05:01:00.520707', 5, '고래 챌린지 제가 기획하였지만 참여도 해보았어요! 고래는 알면알수록 끝없는 동물이니까요! 😎', 12, 18),
	(8, '2022-08-17 09:36:44.031451', '2022-08-17 16:59:14.140402', 4, '저는 벨루가를 가장 좋아합니다. ', 12, 17),
	(9, '2022-08-17 10:34:36.896026', '2022-08-17 10:34:36.896026', 5, '이번엔 꼭 완주!', 13, 16),
	(10, '2022-08-17 11:12:59.300662', '2022-08-17 11:15:06.895726', 5, '제가 한 번 별들을 찍어보았습니다! :) 스테이지 성공하니 기분이 좋네용! 🧡', 11, 16),
	(11, '2022-08-17 11:20:44.301988', '2022-08-17 11:20:44.301988', 4, '고래 얘기에 제가 빠질 수 없죠. 제가 범고래에 대해 알려드리겠습니다!', 12, 16),
	(17, '2022-08-17 12:19:41.194903', '2022-08-17 12:19:41.194903', 2, '고슴도치 귀엽지만 키우기 어렵습니다 ㅠㅠ', 5, 4),
	(18, '2022-08-17 13:19:23.875471', '2022-08-17 13:19:23.875471', 4, '무라카미 하루키 너무 좋은 작가죠! 항상 재미있게 읽고 있습니다!', 1, 15),
	(19, '2022-08-17 13:19:26.066089', '2022-08-17 13:19:26.066089', 5, '손글씨 쓰기가 너무 어려웠는데 덕분에 글씨가 조금씩 예뻐지고 있어요!', 8, 18),
	(20, '2022-08-17 14:21:02.254202', '2022-08-17 14:21:02.254202', 4, '군대에서 노르웨이 숲 읽었었음 ㅋㅋ 재밌었는데 ', 1, 11),
	(23, '2022-08-17 15:10:25.260332', '2022-08-17 15:10:25.260332', 5, '저도 잘 아는 범고래가 있는데 보면 너무 이쁘더라구요', 12, 1),
	(24, '2022-08-17 15:23:16.433130', '2022-08-17 15:23:16.433130', 5, '저는 평창 육백마지기에 다녀왔습니다. 너무 멋진  곳이었어요!', 11, 20),
	(25, '2022-08-17 15:25:11.600993', '2022-08-17 15:25:11.600993', 3, '제겐 너무 어려운 책들이네요...', 13, 11),
	(26, '2022-08-17 15:25:40.881370', '2022-08-17 15:25:40.881370', 5, '요즘 같이 글씨 쓸 일이 별로 없는 사회에서 켈리그라피를 통해 힐링하는 시간이 되었습니다 ㅎㅎ', 8, 11),
	(27, '2022-08-17 15:26:13.997332', '2022-08-17 15:26:13.997332', 5, '이번엔 꼭 고래에 대해 더 많이 공부해보겠습니다! 하늘을 나는 고래도 있을까요?', 12, 20),
	(28, '2022-08-17 15:43:49.738888', '2022-08-17 15:43:49.738888', 4, '이를 계기로 일본영화 한번 도전해볼까요?', 15, 11),
	(29, '2022-08-17 15:48:47.261058', '2022-08-17 15:48:47.261058', 5, '이번엔 꼭 완주!', 15, 18),
	(30, '2022-08-17 15:49:08.849559', '2022-08-17 15:49:08.849559', 5, '지용 너무 좋아용 😍', 23, 18),
	(31, '2022-08-17 16:09:57.233475', '2022-08-17 16:09:57.233475', 4, '글씨 저도 잘 쓰고 싶어요 ㅠㅠ', 8, 4),
	(32, '2022-08-17 16:10:43.057231', '2022-08-17 16:10:43.057231', 5, '자연 친화적인 챌린지라 정말 좋은 것 같아요! 잘 즐기다 갑니다!', 19, 22),
	(33, '2022-08-17 16:13:32.342240', '2022-08-17 16:13:32.342240', 4, '자취하면서 밥먹는게 제일 어려운데, 덕분에 실력이 많이 늘은 것 같아요.! 😊', 7, 22),
	(34, '2022-08-17 16:17:24.319480', '2022-08-17 16:17:24.319480', 5, '악기는 못 다루지만, 듣는 건 항상 행복합니다! 좋은 클래식 연주자를 알아가게 되어서 너무 좋네요🤗', 23, 22),
	(35, '2022-08-17 17:13:23.444240', '2022-08-17 17:13:23.444240', 3, 'AWS 배포 도전!', 28, 17),
	(36, '2022-08-17 17:14:20.004682', '2022-08-17 17:14:20.004682', 5, '도전도전! 할 수 있다!', 28, 26),
	(37, '2022-08-17 17:18:26.435829', '2022-08-17 17:18:26.435829', 5, '라흐마니노프... 제가 한 번 들어보겠습니당', 23, 26),
	(38, '2022-08-17 17:26:47.346122', '2022-08-17 17:26:47.346122', 4, '요리 정복해보겠습니다!', 7, 26),
	(39, '2022-08-17 17:29:05.620222', '2022-08-17 17:29:05.620222', 4, '저는 그의 소설보다 자서전 형식으로 쓴 글들이 좋더라구요! 달리기를 말할 때 내가 하고 싶은 이야기 추천추천', 1, 26),
	(40, '2022-08-17 17:34:36.901035', '2022-08-17 17:34:36.901035', 5, '자연을 느낄 수 있어 좋았습니다! 고구마 키우기 이번에는 성공해보겠습니다!', 19, 26),
	(41, '2022-08-17 17:53:47.817475', '2022-08-17 17:53:47.817475', 5, '완주 성공!', 17, 26),
	(42, '2022-08-18 15:27:30.035020', '2022-08-18 15:27:30.035020', 5, '정말 좋은 기획인것 같습니다!', 12, 30),
	(43, '2022-08-19 01:14:31.872397', '2022-08-19 01:14:31.872397', 4, '\'직업으로서의 소설가\'도 재밌어요!!', 1, 36);
