INSERT INTO `stage` (`id`, `created_date`, `modified_date`, `content`, `img`, `name`, `stage_order`, `challenge_id`) VALUES
	(1, '2022-08-16 22:27:13.023005', '2022-08-16 22:27:13.023005', '<p>운동을 하기전 간단히 몸을 풀어줍시다!</p>', '', '스트레칭하기', 1, 2),
	(2, '2022-08-16 22:28:53.774911', '2022-08-16 22:28:53.774911', '<ul><li>순서를 따라 해봅시다.</li></ul><ol><li>벤치에 눕는다</li><li>빈봉을 들어올린다</li><li>흉부와 수직으로 내린다</li><li>다시 올린다</li><li>2-4를 한동작으로 반복해봅시다.</li></ol>', '', '벤치프레스하기', 2, 2),
	(3, '2022-08-16 22:30:22.805129', '2022-08-16 22:30:22.805129', '<p><span class="ql-size-large">스쿼트는 다리운동입니다!</span></p><ul><li>순서를 따라 해봅시다.</li></ul><ol><li>양발을 어깨넓이만큼 위치하고 선다.</li><li>발끝과 무릎방향을 일치시킨다</li><li>방향을 유지하면서 불련하지 않게 앉아본다</li><li>2-3를 한동작으로 반복해봅시다.</li></ol><p><br></p>', '', '스쿼트', 3, 2),
	(4, '2022-08-16 22:32:04.975440', '2022-08-16 22:32:04.975440', '<p><span class="ql-size-large">제가 제일 좋아하는 운동이에요!</span></p><ul><li>순서를 따라 해봅시다.</li></ul><ol><li>빈봉을 거치대에 놓는다.</li><li>빈봉을 잡는다</li><li>주저앉고, 허리는 중립을 유지하면서 들어올린다.</li><li>빈봉을 몸에 붙여서 내려놓는다</li><li>2-4를 한동작으로 반복해봅시다.</li></ol><p><br></p>', '', '데드리프트하기', 4, 2),
	(5, '2022-08-16 22:32:53.272080', '2022-08-16 22:32:53.272080', '<p><span class="ql-size-large">힘들지만 꼭 필요한 운동입니다.</span></p><ol><li>걷는거부터 시작해서</li><li>달리기까지 30분동안 유지가능한 속도로 뛰어봅시다.</li></ol>', '', '유산소하기', 5, 2),
	(6, '2022-08-16 23:02:42.508341', '2022-08-16 23:38:37.706181', '<blockquote>고요한 와타나베의 삶에 어느새 수채화처럼 스며든 나오코는 그에게 상실을 안겨줍니다.</blockquote><blockquote>\'슬픔에서 우리는 무언가를 배우는 것 뿐이고, 그렇게 배운 무엇도 또 다가올 슬픔에는 아무런 소용이 없다\'라는 문구가 좋았던 책이에요~</blockquote>', '', '노르웨이 숲 ', 1, 1),
	(7, '2022-08-16 23:23:25.644450', '2022-08-16 23:38:37.727799', '<blockquote>세련된 제목입니다. 15살 소년의 깊은 방황이 우리에게 큰 울림을 줍니다. 어린 나이에 집을 떠나 홀로 타지에서 살아가는 카프카의 독립은 현실과 맞닿아있기도 하고 맞닿아있지 않기도 해 더욱 가슴을 뛰게합니다. 장마로 인해 어디론가 훌쩍 떠나지 못했다면 카프카와 함께 해변으로 설레는 여행을 떠나보는건 어떨까요?</blockquote>', '', '해변의 카프카 1, 2', 2, 1),
	(8, '2022-08-16 23:26:49.564762', '2022-08-16 23:35:31.831098', '<p>우선 고슴도치를 키우기 위해서는 중요하게 해야할 일이 있습니다.</p><p>미리 이 동물이 어떤 동물인지를 알아보는 것입니다.</p><p>많은 사람들이 애완동물 또는 반려동물을 그저 처음엔 재미삼아 키워볼까 생각들을 하고 있다는 것을 알고 있습니다.</p><p>하지만 그러한 안일한 생각으로 시작할 경우, 동물과 사람 모두 불행해지는 결과를 초래할 수 있습니다.</p><p>그렇기 때문에 키우기 전에 고슴도치에 대해서 알아보는 시간을 가져야 합니다.</p><p>이 스테이지에서는 다들 고슴도치가 어떤 동물인지 각자 공부한 바를 포스팅해보기로 해요!!</p><p><br></p><p><span class="ql-size-small">사실 저는 여담이지만,,, 소닉 3 더 헷지호그 게임을 시작으로 고슴도치에 대해 처음으로 알아봤습니다...</span></p>', '', '고슴도치를 알아봅시다! Let\'s know sonic!', 8, 5),
	(9, '2022-08-16 23:31:32.755708', '2022-08-16 23:38:37.727462', '<blockquote>이 소설은 하루키에게 그동안 익숙했던 일인칭 시점을 벗어나 제 3자의 입장으로 등장인물을 바라본다는 점에서 그는 \'도전\'이라고 표현했습니다. 플라톤의 이데아를 접목하여 그가 생각하는 이데이란 무엇인가를 쉽고 재미있게 풀어냈습니다. 그렇지만 이데아라는 어려운 개념보다는 그의 담담한 문장들이 오래 기억에 남았습니다.</blockquote><blockquote><em>\'깊숙이 들여다보면 어떤 인간이든 저 안쪽에 반짝이는 무언가를 갖고 있기 마련이다.\' </em></blockquote><blockquote>저에게도 그러한 반짝이는 무언가가 있다는 용기를 준 책이라 더욱 함께 다양한 이야기를 나누고 싶습니다.</blockquote>', '', '기사단장 죽이기 1, 2', 3, 1),
	(10, '2022-08-16 23:32:13.312251', '2022-08-16 23:32:13.312251', '<p>고슴도치 사육장은 어떤 형태를 띄워야 할까요? 사진으로 만나보시죠! 이와 같은 사육장을 준비해서 포스팅해주세요!</p>', '', '고슴도치 사육장을 만들어보자', 10, 5),
	(11, '2022-08-16 23:46:21.041737', '2022-08-16 23:46:59.918777', '<p>고슴도치는 단백질이 풍부한 먹이를 먹어야 합니다. 그래서 사료를 고를 때도 고슴도치 전용 사료로 고르는 것은</p><p>당연한 일이고 때로는 건조 밀웜, 또는 그냥 생 밀웜을 줘도 됩니다.</p>', '', '고슴도치 먹이를 선별해보자 ', 11, 5),
	(12, '2022-08-17 00:00:45.429964', '2022-08-17 00:02:04.526940', '<p>구현 유형은 그 어떤 알고리즘을 공부하기에 앞서 반드시 확실히 하고 가야 하는 유형입니다.</p><p>왜냐고요? 이유는 간단해요. 구현 문제 하나만으로 이 사람이 코딩 테스트에 사용되는 프로그래밍 언어를</p><p>얼마나 이해하고 있는지, 또 문제에서 요구하는 사항을 어떻게 특정 알고리즘 외의 논리적인 형태로</p><p>해결하는지 볼 수 있기 때문입니다.</p><p><br></p><p>그래서 여러분들은 반드시 구현 문제를 많이 풀어보고 다룰 줄 알아야 해요! 아시겠죠!</p><p>이 스테이지의 포스팅에는 반드시 본인들이 푼 구현 문제의 코드와 문제에 대한 설명을 달아주세요!</p><p><br></p><p>소곤소곤하자면... 백준에 구현 문제 많아요!</p><p><br></p><p>사진이 기본 레고 블럭인 이유는... 구현이야말로 모든 것의 기본이기 때문에 넣었습니당 ㅎㅎ  </p>', '', '구현, 그 모든 것의 시작일지어니.', 12, 6),
	(13, '2022-08-17 00:06:33.199767', '2022-08-17 00:06:33.199767', '<p>탐욕법, 그리디 알고리즘, 또는 그때그때마다 최선의 선택을 하는 것.</p><p>이 그리디 알고리즘을 표현하는 여러 가지지만 그 뜻이 가지는 명확해요. 가장 탐욕스럽게 행동하는 알고리즘이</p><p>바로 그리디 알고리즘이란 거죠.</p><p>근데 항상 그럴까요? 무슨 말이냐면... 때로는 어느 순간은 참고 어느 순간에 확!!! 욕망을 펼칠 때가 최선인 때가 있다는 거죠.</p><p><br></p><p>그래서 그리디 알고리즘은 가장 직관적이면서도 직관적이지가 않습니다. 그리디 알고리즘이 먹힐려면</p><p>우선 스스로에게 이 질문을 해봐야 해요. 내가 여기서 이렇게 행동하는게 최선일까? 매 순간 최선의 선택지를 고른다고 할 때, 그 결과가 정말 최선일까?</p><p><br></p><p>사실 코딩 세계에는 이런 말이 있죠. 백문이불여일타! 100번 듣는 것이 한번 코드로 치는 것보다 못하다는 거에요.</p><p>그러니까 다들 첫번째 스테이지처럼 그리디 문제를 하나 풀어보고 문제에 대한 설명과 함께 그 코드를 포스팅해주세요!</p><p><br></p><p>다들 화이팅~~~</p>', '', '2번째 관문, 그것은 바로 그리디! ', 13, 6),
	(14, '2022-08-17 00:21:05.375224', '2022-08-17 00:22:37.804552', '<p>미로 속에서 정답을 찾아 헤매는 문제가 주로 나오는 완전 탐색 유형 차례입니다!</p><p>완전 탐색이라고 하면 우선 두 가지 알고리즘을 알아야 합니다.</p><p>바로 BFS와 DFS 입니다!</p><p>우선... 이해를 돕기 위해 BFS와 DFS가 어떤 것인지 간단하게 설명만 해드릴게요.</p><p>아무래도 알고리즘 공부는 본인이 알아서 해야 하는 것이다보니 AtoZ 까지 다 말해드려도 소용 없거든요!</p><p><br></p><p>BFS는 마치 호숫가에 돌을 던져 파문을 일으키는 탐색법이에요.</p><p>파문은 원형으로 퍼져 나가겠죠? 그리고 그 중심에서부터의 위치에 따라 걸리는 시간이 결정되겠죠?</p><p>예를 들어 중심에서부터 3만큼 떨어지는 두 점이 있다고 해볼까요?</p><p>그럼 그 원점에서부터 원형의 파문처럼 탐색을 시작했을 때 두 점을 확인하는 시간은 얼마나 걸릴까요?</p><p>정답은 3만큼의 시간이 흐르고 동시에 확인한다 입니다! 이해가 좀 가실까요?</p><p><br></p><p>DFS는 그럼 어떻게 이해를 해야할까요? DFS는 정말 미로를 탐색하는 거라고 생각하시면 됩니다.</p><p>다만 그 미로를 무조건 벽을 만날 때까지 전진하는 거에요. 벽을 만난다면? 가보지 않은 길이 나왔던 때로 돌아갑니다</p><p>그럼 어떻게 될까요? 갈림길을 만났다고 해보죠. 거기서 왼쪽으로 쭉~ 갔다가 벽에 막혔어요</p><p>그럼 갈림길까지 다시 돌아와서 이번엔 오른쪽으로 가는 식의 알고리즘이에요.</p><p>이해가 잘 안가신다구요? 전 설명을 잘한 것 같은데... 읽으시는 분이 문제가... 하하 아닙니다!</p><p><br></p><p>그럼 이번 포스트는 둘 중 하나를 골라서 문제를 푼 뒤 올려주시면 돼요!</p><p>하지만 추천드리는 것은.. BFS! 완전 탐색 문제에서 정말 단골 중에 단골이거든요. 알겠죠?</p>', '', '완전탐색, 당신은 과연 답을 찾을 수 있나요!!', 14, 6),
	(15, '2022-08-17 00:26:00.526720', '2022-08-17 00:26:43.421471', '<p>재귀함수를 다들 배운 적이 있을 거에요. 배우실 때 재귀함수의 단점도 함께 배웠을지 모릅니다.</p><p>어느 부분에서 문제가 일어나는지 알기 힘들다, 호출 스택이 깊어질수록 제어하기가 힘들다 이런 점들이 있죠.</p><p>근데 이런 위험한 재귀를 쓰면 문제가 쉽게 풀릴 때가 있습니다. 바로 동적 프로그래밍, 일명 DP 문제를 풀 때입니다.</p><p><br></p><p>DP 문제는 크게 두 가지의 방식으로 나뉘어요. 탑다운과 바텀업. 보통 효율이나 깔끔한 코드를 고려할 때는 바텀업으로 하지만 제가 풀어볼 땐 탑다운이 초보에겐 잘 어울리더라구요!</p><p>자 화이팅! DP 문제의 가장 쉬운 유형인 가장 긴 증가하는 수열을 찾는 것부터 한번 해볼까요?</p>', '', '동적 프로그래밍.. 재귀를 이래서 배웠구나 알게 되는 순간입니다.', 15, 6),
	(16, '2022-08-17 00:44:48.936841', '2022-08-17 00:44:48.936841', '<p><span style="color: rgb(68, 68, 68);">내가 쳐야할 흰 공이 당구대 위에 있습니다. 큐를 이용해서 각도를 정하고 </span><span style="color: rgb(255, 153, 0);">큐선</span><span style="color: rgb(68, 68, 68);">을 일치 시킵니다. </span></p><p><span style="color: rgb(68, 68, 68);">큐 끝을 흰공 바로 앞에까지 대 놓으면 거리 조절이 됐다고 할 수 있습니다. </span></p><p><span style="color: rgb(68, 68, 68);">이 상태에서 </span><strong style="color: rgb(68, 68, 68);">45도</strong><span style="color: rgb(68, 68, 68);"> 각도로 발을 비튼 다음에 흰공의 한 뼘 앞 정도에 손바닥을 대고 브릿지를 만듭니다. </span></p><p><span style="color: rgb(68, 68, 68);">자연스럽게 허리가 굽혀져 있을 것입니다. </span></p><p><span style="color: rgb(68, 68, 68);">예비 스트로크를 하다가 임팩트 즉 흰공을 친 후 팔로우샷을 하고 공이 진행하는 모습을 잠시 확인하면서 </span><span style="color: rgb(230, 0, 0);">마무리 자세를 유지</span><span style="color: rgb(68, 68, 68);">한 후에 허리를 펴고 일어섭니다. </span></p><p><span style="color: rgb(68, 68, 68);">이것이 샷의 과정이라고 할 수 있습니다.</span></p>', '', '당구 자세 잡기', 16, 4),
	(17, '2022-08-17 00:49:22.589979', '2022-08-17 00:50:01.512364', '<p>탱크가 격자판에서 움직인다는 문제가 제가 아마 처음으로 풀어본 시뮬레이션 문제였습니다.</p><p>그 때 이제 IT 교육을 받고 있던 때라 다른 28명의 친구들과 같이 풀었었죠.</p><p>아마 4,5등 했을 겁니다. 문제 푼 등 수가요.</p><p><br></p><p>구현이랑 뭐가 다르냐고 하실 분들도 계시지만...</p><p>정해진 규칙 안에서 시뮬레이션을 돌리는 유형은 분명히 구현과 다릅니다. 충분히 좋은 경험이 될거에요!</p><p><br></p><p>그리고 당연히 코딩 테스트에도 단골로 나오는 문제구요!</p><p>이번 스테이지에도 마찬가지로 포스팅은 문제에 대한 설명과 코드를 자유롭게 올려주심 됩니다!</p>', '', '구현과는 약간 다른.. 시뮬레이션! 이걸 잘하면 게임 개발도 잘할지도?', 17, 6),
	(19, '2022-08-17 01:36:46.960795', '2022-08-17 01:48:40.206941', '<p>글을 잘 쓰기 위해 종이와 펜을 준비해봐요!</p><p>가까운 문구점에서 붓펜, 유성 색연필, <span style="color: rgb(51, 51, 51);">피그먼트 라이너펜, 책갈피 종이, 5x7 엽서지, 4x6 엽서지, 원목 엽서꽂이 등 맘에 드는 재료들을 쇼핑해요!</span></p><p>새로운 시작을 위해 설레는 마음으로 준비를 해요 ㅎㅎ</p>', '', '준비물 준비하기', 18, 8),
	(20, '2022-08-17 01:47:45.222934', '2022-08-17 01:48:16.600548', '<p>가는 붓펜의 결을 이해하고, 선긋기와 자음, 모음을 차근차근 연습해봅니다.</p><p>가로선/세로선/여러가지 선을 연습하면서, 붓펜을 처음으로 다뤄보는 시간을 가집니다.</p>', '', '가는 붓펜을 이용한 선긋기/자음/모음 연습하기', 19, 8),
	(21, '2022-08-17 01:49:50.355685', '2022-08-17 01:49:50.355685', '<p><span style="color: rgb(51, 51, 51);">선긋기에서 익힌 가로선과 세로선을 이용해서 모음과 자음을 써볼거에요.</span></p><p><span style="color: rgb(51, 51, 51);">모음보다 조금 더 까다롭고 어려운 자음도 붓펜의 결을 이해하면 훨씬 잘 쓸 수 있답니다.</span></p>', '', '가로선과 세로선을 이용해 모음과 자음 써보기', 20, 8),
	(22, '2022-08-17 01:50:31.550152', '2022-08-17 01:50:31.550152', '<p><span style="color: rgb(51, 51, 51);">가는 붓펜으로 연습한 자음과 모음을 합쳐서 단어와 짧은 문장을 연습해보겠습니다.</span></p><p><span style="color: rgb(51, 51, 51);">자음과 모음이 합쳐질 때, 모양이 변하는 자음들을 배워보아요.</span></p><p><span style="color: rgb(51, 51, 51);">글씨에 멋을 더해주는 포인트가 될 자음과 받침 글자도 더 연습해볼거에요.</span></p>', '', '가는 붓펜으로 단어와 짧은 문장연습하기', 21, 8),
	(23, '2022-08-17 01:51:09.749297', '2022-08-17 01:51:09.749297', '<p><span style="color: rgb(51, 51, 51);">평소에 좋아하는 글귀나 노래 가사로 작은 글씨를 이용해 나만의 문장을 연습 해볼거에요.</span></p><p><span style="color: rgb(51, 51, 51);">한 줄 쓰기, 두 줄 쓰기 등 같은 문장도 다양한 구성으로 여러가지 표현을 할 수 있답니다.</span></p>', '', '나만의 문장 다양하게 써보기', 22, 8),
	(24, '2022-08-17 01:51:32.346236', '2022-08-17 01:51:32.346236', '<p><span style="color: rgb(51, 51, 51);">연습해본 나만의 문장들을 책갈피로 만들어보는 시간입니다.</span></p><p><span style="color: rgb(51, 51, 51);">문장에 어울리는 작은 그림도 색연필을 이용해 그려볼거에요.</span></p><p><span style="color: rgb(51, 51, 51);">글귀에 어울리는 작은 그림들은 나의 글씨를 더욱 빛나게 해준답니다!</span></p>', '', '가는 붓펜 글씨로 캘리 책갈피 만들기', 23, 8),
	(25, '2022-08-17 01:51:54.973271', '2022-08-17 01:51:54.973271', '<p><span style="color: rgb(51, 51, 51);">굵은 붓펜을 잡는 방법과 누르는 힘에 따른 굵기 변화를 연습해보는 시간입니다.</span></p><p><span style="color: rgb(51, 51, 51);">가는 붓펜과는 또 다른 느낌의 굵은 붓펜 글씨를 함께 써볼게요.</span></p>', '', '굵은 붓펜으로 자음/모음/단어 연습하기 ', 24, 8),
	(26, '2022-08-17 01:52:30.575107', '2022-08-17 01:52:30.575107', '<p><span style="color: rgb(51, 51, 51);">문장 속에서 하나의 단어를 골라, 붓펜의 굵기 변화를 이용해 단어를 강조하는 연습을 해보는 시간입니다.</span></p>', '', '붓펜의 굵기 차이를 이용해 단어/문장 강조하기', 25, 8),
	(27, '2022-08-17 01:53:04.914349', '2022-08-17 01:53:04.914349', '<p><span style="color: rgb(51, 51, 51);">작은 원형 스티커 안에 다양한 글씨를 써보면서 균형감과 구성 연습을 함께 해보는시간입니다.</span></p><p><span style="color: rgb(51, 51, 51);">처음엔 어렵게 느껴질 수 있지만, 제가 보여드리는 예시들로 함께 연습하다보면 원하는 문구를 예쁘게 구성할 수 있게 될 거에요.</span></p>', '', '구성연습 - 원형 스티커 만들기', 26, 8),
	(28, '2022-08-17 01:53:24.686619', '2022-08-17 01:53:24.686619', '<p><span style="color: rgb(51, 51, 51);">가는 펜과 굵은 펜을 함께 이용해서 긴 문장을 구성하는 연습을 해볼거에요.</span></p><p><span style="color: rgb(51, 51, 51);">두 줄 이상의 문장을 쓸 때 예쁘게 써지는 방법도 배워보아요.</span></p>', '', '구성연습 - 가는 붓펜과 굵은 붓펜을 이용해 긴문장 적기', 27, 8),
	(29, '2022-08-17 01:54:07.165963', '2022-08-17 01:54:49.217313', '<p><span style="color: rgb(51, 51, 51);">맘에 드는 문구를 골라, 나만의 엽서와 엽서 달력을 만드는시간입니다.</span></p><p><span style="color: rgb(51, 51, 51);">어떤 문장을 쓸지, 어떻게 구성할 지 생각해보고 글씨에 어울리는 작은 그림도 함께 넣어보는 시간입니다.﻿</span></p>', '', '캘리엽서와 엽서 달력 만들기', 28, 8),
	(30, '2022-08-17 01:54:07.508076', '2022-08-17 01:54:07.508076', '<p>연습 스트로크 또는 팔로우 스트로크 중에 등 어깨가 움직이지 않는 것이 중요합니다.</p><p>스트로크를 할 때 큐를 흔드는 손을 꽉 쥐면 <span style="color: rgb(161, 0, 0);">안 됩니다</span>. 큐가 수평을 유지할 수 있게 느슨하게 잡아줍니다.</p><p>예비 스트로크를 할 때는 큐가 가능한 테이블과 수평을 유지한 상태에서 앞뒤로 움직이는 것이 정확한 당점을 가격하기에 유리합니다.</p><p>좋은 스트로크를 만들기 위해서 <span style="color: rgb(0, 71, 178);">빈 스트로크 연습</span>을 많이 해야 합니다.</p><p>공을 놓고 연습할 때에는 <span style="color: rgb(0, 97, 0);">같은 배치를 여러 번</span> 연습하는 것이 중요합니다. 매번 다른 배치로 연습을 하다보면 일관성 있는 스트로크 연습을 할 수 없어 비효율적입니다.</p>', '', '당구 스트로크', 29, 4),
	(31, '2022-08-17 02:07:03.838507', '2022-08-17 10:09:43.177044', '<p>세상은 1인 가구에 맞춰져 있을까요? 아니요, 그렇지 않습니다.</p><p>전통적인 대가족의 형태는 붕괴된 지 오래라 쳐도 핵가족, 즉 네다섯 명의 가족 구성원을 염두에 두고</p><p>모든 식재료는 생산되고 공정을 거치며 판매되는 겁니다.</p><p>혹시 이렇게 말할 수도 있죠. 1인 밀키트, 혹은 그냥 재료를 살 때 적게 사면 되는 것 아니냐고.</p><p>맞아요. 그렇게 생각할 수도 있죠. 하지만 비싸요. 비싸다구요.</p><p>비싸 비싸 비싸 비싸 비싸 비싸 비싸 비싸 비싸 비싸 비싸 비싸 비싸 비싸 비싸 비싸요!</p><p>그러면 어떡해야 할까요? 정답은 바로 소분입니다.</p><p>작게 나눠서 저장해야 된다 이거에요.</p><p>2,3인분으로 판매되는 재료들 특히나 육류가 그렇죠. 냉동으로 와도 소분은 필수랍니다.</p><p>해동시켜서 먹을 때 2,3인분을 그대로 해동할 순 없잖아요!</p><p>그래서 이번 스테이지의 포슨팅은 여러분이 산 재료를 소분한 사진을 올려주세요!</p><p>요리의 시작은 식재료라는 점, 잊지 마시구요.</p>', '', '1인 가구의 식재료 구매하기!', 30, 7),
	(32, '2022-08-17 02:11:58.033417', '2022-08-17 02:11:58.033417', '<ul><li>물을 적당히 준비하고</li><li>면도 적당히 준비하고</li><li>물에 소금 한수저정도로 간을 하고 파스타를 8분 삶아줍시다</li></ul>', '', '파스타 면삶기', 31, 9),
	(33, '2022-08-17 02:12:24.722834', '2022-08-17 02:12:24.722834', '<ul><li>그대가 좋아하는 재료들로 파스타 재료를 손질해보아요</li><li>칼질이 서툴다면 그냥 손으로 잡아뜯으세요</li></ul>', '', '파스타 재료 손질', 32, 9),
	(34, '2022-08-17 02:13:14.802785', '2022-08-17 02:13:14.802785', '<ul><li>오늘 내가 요리사, 근데 파스타를 곁들인..</li><li>팬을 달구고 오일을 뿌려 파스타 면과 소스가 어우러지도록 볶아주세요</li><li>맛있는 <strong class="ql-size-large" style="color: rgb(255, 153, 0);"><em><u>파스타 </u></em></strong>완성!</li></ul>', '', '파스타 볶기', 33, 9),
	(35, '2022-08-17 02:21:39.407309', '2022-08-17 02:21:39.407309', '<ul><li>초밥의 땅은 밥, 하늘은 횟감입니다.</li><li>맛난 밥을 찰지게 지어주세요</li><li>짓고 난 밥을 식히면서 식초와 소금으로 간을 해주세요</li></ul>', '', '맛난 밥을 지어주세요', 34, 10),
	(36, '2022-08-17 02:24:41.742777', '2022-08-17 02:24:41.742777', '<p>스시에서 단백질을 담당하는 회를 썰어봅시다</p><ol><li>지중해에서 펄떡거리면 뛰어다녔을 물고기 친구를 위하는 경건한 마음으로 칼질을 준비합니다.</li><li>회칼은 매우 날카로우므로 자비없이 썰어주세요</li><li>다시마로 감싸 숙성하면 이게 바로 판당 사만원 숙성회</li></ol>', '', '회감을 썰어봅시다.', 35, 10),
	(37, '2022-08-17 02:25:40.863258', '2022-08-17 02:25:40.863258', '<p>팔도 네넴띰 아구 이게 아니라..</p><ol><li>왼소으로 밥을 적당량 쥐고 모양을 만들어</li><li>썰어놓은 회를 얹어주세요</li><li>초밥완성 하지만 마지막이 남았어요</li></ol>', '', '왼손으로 만들고 오른손으로 쥐고', 36, 10),
	(38, '2022-08-17 02:26:39.708224', '2022-08-17 02:26:39.708224', '<p>초밥의 친구, 초밥의 단짝, 초밥의 내장</p><ul><li><span class="ql-size-huge" style="color: rgb(178, 178, 0);">와사비</span>를 갈아줍시다.</li><li>생와사비라면 좋지만 없으면 제품</li><li>그것도 없다면 그냥 밥에 물고기살점 얹어먹는거니 알아서 드세요 네</li></ul>', '', '시즈오카를 아십니까?', 37, 10),
	(39, '2022-08-17 03:21:41.924414', '2022-08-17 03:39:41.721872', '<p>휴대폰으로 은하수를 찍을 수 있습니다.</p><p>단, 삼각대가 필요합니다.</p><p>움직임 없이 오랜 시간 밤하늘을 노출시켜야하기 때문인데요.</p><p>ISO 800으로 맞추고, 셔터 스피는 15초로 해주세요!</p><p>만약 너무 어둡고 별이 적게 찍힌다면, ISO를 1600으로 맞추어 주세요. 혹은 셔터 스피드를 더 길게 조정해주셔도 됩니다.</p><p>초점은 수동초점으로 바꾸고 타이머는 5초로 설정하면 됩니다.</p><p>너무 간단하죠? 🥰</p><p>휴대폰으로 촬영한 다양한 별사진을 포스팅으로 남겨봅시다.</p>', '', '휴대폰으로 은하수 찍기', 38, 11),
	(40, '2022-08-17 03:28:29.389067', '2022-08-17 03:39:59.833773', '<p>터널을 지나 펼쳐지는 밤 하늘, 낭만적이지 않나요? 💛</p><p>서울에서 가깝다는 이점때문에 별들을 사랑하는 많은 사람들이 명소로 꼽는 장소입니다.</p><p>별을 카메라에 담는 법에 익숙해졌다면 양평 벗고개를 방문해보는 건 어떨까요?</p><p>긴 터널을 지나 끝없이 이어지는 밤하늘을 만나봅시다.</p>', '', '양평 벗고개', 39, 11),
	(41, '2022-08-17 03:30:58.141385', '2022-08-17 03:30:58.141385', '<p>이곳은 조금 먼 곳이지만 망원경으로 우주를 더 자세히 관찰할 수 있는 곳입니다.</p><p>하늘의 많은 별들은 이름을 가지고 있습니다.</p><p>잔디에 누워 멀리서 별을 바라보기도 하고, 망원경을 이용하여 별을 자세히 관찰해 보세요.</p><p>다른 사람이 발견하지 않은 별을 발견하는 행운을 만날수도 있지 않을까요? 😉</p>', '', '조경철 천문대', 40, 11),
	(42, '2022-08-17 03:33:02.554379', '2022-08-17 03:41:14.353694', '<p>별을 가장 잘 관찰할 수 있는 여름이지만, 열대야로 인해 너무 덥습니다. 💦</p><p>평창은 여름 내내 시원하여 별을 관찰하기 좋은 장소입니다.</p><p>많은 야생화들이 흐드러지게 피어있고, 산과 밤을 온전히 즐길 수 있는 곳입니다. ✨</p><p>하늘에 은하수가 한가득 펼쳐지는 모습을 눈 가득 담아보세요~</p>', '', '평창 육백마지기', 41, 11),
	(43, '2022-08-17 04:24:07.909110', '2022-08-17 04:57:32.729702', '<p><strong>남방큰돌고래들은 불법포획으로 수족관에 갇히게 되었습니다. </strong></p><p>2013년부터 태산이는 서울대공원으로 옮겨져 단짝 복순이와 2년 정도 머물렀어요~</p><p>그리고 2015년 방사되었습니다.</p><p>하지만 최근 태산이가 운명을 달리했다는 소식이 들렸습니다. 😥</p><p><br></p><blockquote><strong>고래에 대해 누구보다 많이 알기, 첫 스텝 남방돌고래로 시작해보는건 어떨까요? 🐬</strong></blockquote>', '', '태산이에 대해 알아보기', 1, 12),
	(44, '2022-08-17 04:37:11.518854', '2022-08-17 04:56:38.256872', '<p><strong>현존하는 고래 중 가장 큰 이빨을 가진 고래는???</strong> <strong><u>바로 향고래입니다.</u></strong></p><p>향고래는 엄청 거대하고 수컷의 경우 20m 까지 자란다고 하는데요.</p><p>목격된 적이 많이 없지만 서서 자는 고래, 유대감이 높아 무리에서 낙오고래를 만들지 않는 고래로 유명합니다.</p><p><strong style="color: rgb(0, 102, 204);">향고래는 가장 의리있고 정의로운 동물같아요.</strong></p><p>얕은 물에서 허우적 거리는 동료를 돕다 무리 전체가 대참사를 당하는 일도 있었습니다.</p><p>향고래를 공부하며 다양한 이야기를 나누어봅시다.</p>', '', '향고래에 대해 알아보자.', 3, 12),
	(45, '2022-08-17 04:46:16.268218', '2022-08-17 04:57:46.654820', '<p>백색증으로 오해 받지만 원래 하얀 돌고래 입니다.</p><p>태어났을 땐 노란빛이나 회색빛을 띄지만, 성장하면서 흰색으로 색이 바뀝니다.</p><p>차가운 극지방에 살기 때문에 블러버라는 지방층으로 덮여져있는데요.</p><p>말랑말랑한 머리는 멜론이라는 기름으로 채워져 있어요.</p><p>바다의 카나리아라는 별명도 가지고 있죠.</p><p>벨루가에 대해 알고싶다면 BBC 스튜디오 다큐를 시청해보세요!</p><p>유튜브에서 벨루가에 대해 공부하고 이곳에 포스팅을 올려봅시다.</p>', '', '하얀 고래, 벨루가', 2, 12),
	(46, '2022-08-17 04:53:41.559571', '2022-08-17 04:59:46.999946', '<p>어디 눈이 있지?👀 하고 가만히 들여다보게 되는 고래, 바로 범고래입니다.</p><p>몸집에 비해 눈이 작고 흰자가 차지하는 비율이 적어서 그런데요. 자료가 부족해서 멸종위기인지 알 수 없는 고래로 기록되어있습니다. 그렇지만, 못먹는 것이 없을정도로 고래들 중 최상위 포식자라고 불리우죠. 그래서 상어를 사냥합니다. 상어를 뒤집어 익사 시킨 후 지방이 풍부한 간만 빼먹죠.</p><p>내셔널 지오그래픽에서 범고래를 자세히 다루고 있습니다. 한 번 찾아 공부해보고 관련 내용을 공유해봅시다!</p>', '', '최상위 포식자, 범고래', 45, 12),
	(47, '2022-08-17 08:45:11.296279', '2022-08-17 09:15:34.047607', '<p>헤르만헤세의 \'수레바퀴 아래서\'를 처음 접했을 때 주인공의 감정이 잘 이해가 가지 않았어요.</p><p>하지만 읽으면 읽을수록, 곱씹으면 곱씹을수록 그의 문장은 저의 삶에 큰 위로가 되었습니다.</p><p>그의 책에서 제가 가장 좋아하는 구절 입니다.</p><blockquote>\'줄기가 잘린 나무에서도 다시 새로운 싹이 움터 나온다. 이처럼 병들어 상처 입은 영혼 또한 꿈으로 가득 찬 봄날 같은 어린 시절로 되돌아가곤 한다. 어떤 상황에서도 우리는, 새로운 희망을 찾아내어 끊어진 생명의 끈을 다시금 이을 수 있다.\'</blockquote>', '', '수레바퀴 아래서 - 헤르만 헤세', 46, 13),
	(48, '2022-08-17 08:57:55.093670', '2022-08-17 08:58:23.904246', '<p><strong>프랑수아즈 사강은 자유로운 영혼으로 유명한 프랑스 작가입니다. 그녀의 스타일은 책에서도 잘 드러납니다. </strong></p><p>폴과 로제는 오랜 연인관계로 로제는 폴이외의 다른 여자들과 자유롭게 만남을 이어가는 바람둥이에요.</p><p>반면 폴은, 로제만이 자신의 사랑이라고 생각하죠. 이런 그녀에게 25살의 맑고 솔직한 청년 시몽이 다가옵니다.</p><p>많은 나이 차이에 대한 부담감과 로제에 대한 사랑 때문에 갈팡질팡하는 폴의 마음을 따라가며 읽어보는 것을 추천합니다.</p>', '', '브람스를 좋아하세요... ', 47, 13),
	(49, '2022-08-17 09:09:09.716343', '2022-08-17 09:16:37.401490', '<p>레오나르도 디카프리오가 연기를 하며 더욱 더 유명해진 위대한 개츠비, 그의 세계로 여러분을 초대합니다.</p><blockquote>\'나는 그곳에 앉아 그 오랜 미지의 세계를 곰곰이 생각하면서 개츠비가 데이지의 부두 끝에서 초록색 불빛을 처음 찾아 냈을 때 느꼈을 경이감에 대해 생각해 보았다. 그는 이 푸른 잔디밭을 향해 머나먼 길을 달려왔고, 그의 꿈은 너무 가까이 있어 금방이라도 손을 뻗으면 닿을 것만 같았을 것이다.\'</blockquote>', '', '위대한 개츠비 - 스콧 피츠 제럴드', 48, 13),
	(50, '2022-08-17 09:13:50.229666', '2022-08-17 09:14:15.335372', '<p>읽고 있으면 우울해진다는 평가가 많은 다자이 오사무의 인간 실격입니다.</p><p>저는 빠르게 이어지는 전개에 정신을 차릴 수 없었습니다. 하지만 읽고난 후 오히려 그 몽롱함이 좋았달까요? 😮</p><p>이 책을 읽을 때는 책 뒤편에 있는 해설을 먼저 읽어보시길 강력 추천합니다. 💛</p>', '', '인간 실격 - 다자이 오사무', 49, 13),
	(51, '2022-08-17 09:29:00.257593', '2022-08-17 09:30:59.681431', '<p>우리는 깨어지지 않는 안온한 삶을 살기 위해 하루에도 얼마나 많은 거짓말을 하고 있나요?</p><p>그러한 거짓말이 난무하는 세상 속에 거짓말을 하지 않는 사람이 오히려 이방인에 가까운 것 같습니다.</p><p>처음에는 잔잔하지만 주인공 뫼르소가 법정 속에서 벌이는 치열한 싸움부터 전개가 흥미진진해 집니다.</p><p>인상깊었던 문구나 장면을 공유해주세요~ 🧡</p>', '', '이방인 - 알베르 카뮈', 50, 13),
	(52, '2022-08-17 09:58:31.617069', '2022-08-17 10:17:04.070032', '<p>커피천으로 화분 구멍을 막고,</p><p>배양토를 화분의 2/3 정도 넣습니다.</p><p>그리고 상추의 모종을 뿌린 뒤, 남은 배양토로 화분을 덮어주세요.</p><p>작은 화분에 너무 촘촘이 상추 씨앗을 뿌리지는 말기!</p><p>더운 여름 강렬한 햇빛은 피하기!</p><p>물은 흙이 마른 것 같을 때 조금씩 조금씩 여린 잎이 상하지 않도록 주시면 됩니다. 정말 쉽죠? 😉</p>', '', '상추의 싹을 틔워보자~', 1, 14),
	(53, '2022-08-17 10:04:06.640768', '2022-08-17 10:23:10.849975', '<p>조금 단계를 높여 열매를 수확해볼까요?</p><p>방울 토마토 모종은 포기 간격을 40-50cm 하여 심어야 합니다.</p><p>그리고 심기 전 심을 곳에 물을 충분히 준 후 심는 것이 좋습니다.</p><p>토마토는 키가 2m 이상 자라기 때문에 지지대 설치는 필수!</p><p>모종을 심은 후 빠르면 10일 정도에 첫 꽃을 보실 수 있어요!</p><p>첫 꽃은 제거하는 것이 정석입니다. 꽃으로 가는 영양분을 막고 건강한 열매를 틔우기 위한 과정입니다!</p>', '', '집에서 재배하는 방울토마토 🍅', 4, 14),
	(54, '2022-08-17 10:10:15.081660', '2022-08-17 10:23:10.849898', '<p><strong>마지막 단계, 대망의 참외키우기 입니다!</strong></p><p>참외 씨앗은 오이 씨앗처럼 생겼어요. 그래서 엄청 여려요!</p><p>참외는 넓게 퍼져나가기 때문에 모종 간 간격을 넓게 잡는 것이 좋습니다.</p><p>제일 난이도가 높은 참외 순치기는 어미 줄기를 제외하고, 아들 줄기와 손자 줄기의 곁순을 순치기 해주시면 됩니다.</p><p>잘 모르겠다면, 복잡한 줄기의 끝을 조금씩 잘라주시면 됩니다~</p><p>참외는 가물어야 당도가 올라가니 너무 많은 물은 금지 😉</p><p>직접 재배한 참외를 올 여름 식탁 위에 올려봅시다~ 🌿</p>', '', '참외키우기!', 5, 14),
	(55, '2022-08-17 10:14:56.641835', '2022-08-17 10:17:01.931407', '<p>자취를 하면서 제 목표는 단연코 한 가지였어요.</p><p>가게에서 파는 맛을 내고 싶다! 내가 돈을 내고 사먹은 것처럼 맛있게 먹고 싶다!</p><p>그런데 요리를 해보신 분은 아시겠지만... 파는 맛을 낸다는 게 정말 쉽지가 않더라구요.</p><p>유투브를 보고 따라해봐도, 백종원 아저씨의 영상을 다 보고 똑같이(실제론 좀 다르지만..) 해봐도</p><p>적당히 맛은 나는데 내가 아는 그 맛은 아니더라구요.</p><p>그러던 와중 한번 생각을 해봤죠. 왜 그럴까? 왜 뭔가 맛이 다 약할까?</p><p>그러다가 유투브에서 어떤 댓글을 하나 봤어요. 설탕을 그냥 팍팍 때려넣으라고 하더라구요 ㅋㅋ</p><p>그래서 이번 포스팅은 구매한 설탕 팍팍 넣은 후기를 올려주세요!</p><p>저는 보통 돼지고기 불고기용 100g당 간장, 맛술, 설탕 1숟가락씩 넣습니다.</p><p>거기다가 좀 설탕을 1,2 숟갈 더 넣어요. 그럼 맛이...!!</p>', '', '설탕, 모든 맛의 중심을 잡아준다', 54, 7),
	(56, '2022-08-17 10:16:04.744793', '2022-08-17 10:23:10.850009', '<p><strong>식물도 성격이 있다는 사실 알고계셨나요?</strong></p><p>당신이 식물을 키워낼 공간엔 햇빛이 얼마만큼 들어오나요?</p><p>바쁜 스케줄로 물 주기를 자주 깜빡하진 않나요?</p><p>만약 그렇다면 햇빛이 들지않는 실내에서도 잘 자라며 1주일에 한 번정도 물을 주면 되는 식물을 추천합니다.</p><p>스파트 필름이라는 식물인데요~ 물이 부족하면 잎이 축 늘어지니 이때를 잊지말고 물을 준다면 오랫동안 당신의 곁을 지켜줄 겁니다.</p>', '', '엄청난 생명력, 스파트필름', 3, 14),
	(57, '2022-08-17 10:22:56.736542', '2022-08-17 10:23:53.369121', '<p>반려동물로 고양이를 키우고 계신가요?</p><p>고양이의 단짝, 캣그라스를 소개합니다.</p><p>씨앗을 심고 물을 흠뻑 주면 2-3일 내로 바로 싹이 돋아납니다.</p><p>매일 몇 센티미터씩 쑥쑥 자라 일주일이면 풀이 풍성해져요!</p><p>금방 자라나기 때문에 5-6일 정도면 고양이에게 귀리를 선물할 수 있습니다.</p>', '', '반려 식물, 캣그라스', 2, 14),
	(58, '2022-08-17 10:23:45.279498', '2022-08-17 10:25:34.456786', '<p>가난한 자취생들에게 한 번의 고기 요리란 단 한 번의 실수도 용납되지 않는 중요한 작업입니다.</p><p>요리 실패시 나오는 음식물쓰레기를 겪을 때면 다신 요리하기가 싫어질 정도죠.</p><p>그래서 요리할 때 원하는 대로 되지 않는 것처럼 느껴지면 그 때부터 불안해요.</p><p>잘못되고 있다고 느껴질 때는... 닭고기를 볶던 돼지고기를 굽던 어느 순간 넘치는 물을 볼 때죠.</p><p>사실 간단해요. 사람도 물이 70퍼라 하잖아요? 고기들도 마찬가집니다. 보이는 것 이상으로 물을 품고 있어요.</p><p>가게에선 특별 양념에 담구고 숯불에 굽고 하니까 사실은 안에 담긴 핏물을 안 빼도 맛이 괜찮습니다.</p><p>그치만 후라이팬에 요리하는 저희는 그렇게 하면 큰일납니다.</p><p>다 증발시키면 되지 않냐고요? 고기를 장시간 가열하면 너무 뻑뻑하고 질겨져 맛이 없습니다.</p><p>그럼 어떡하느냐. 정답은 간단해요. 먼저 뚜겅을 덮고 2,3분만 중불에서 익혀줍니다.</p><p>그 때 나오는 물을 버리고 요리하면 돼요.</p><p>이번 스테이지의 포스팅은 국물 없는 요리로 올려봐요</p>', '', '한번 익혔다가 다시 익히자!', 57, 7),
	(59, '2022-08-17 10:46:17.774674', '2022-08-17 10:51:10.035306', '<p>첫 번째 스테이지에서는 식재료를 사고 나서 어떻게 해야 하는지를 알아봤다면</p><p>이제는 어떤 식재료를 사야 하는지 입니다.</p><p>결론부터 말하죠. 양파, 대파, 마늘, 고추!</p><p>이 네 가지면 충분합니다.</p><p>식감과 영양을 위한 양파와 대파</p><p>그리고 무언가 허전한 맛을 채워줄 마늘!</p><p>마지막으로 한국인의 매운 맛 고추</p><p>이 네 가지면 당신도 이미 충분히 한식 요리자격증 2급 정도는 노려볼 수 있을지도?</p><p>이번 포스팅은 네 가지 재료 구매 후기로 하죠!</p>', '', '자취생이 감당할만한 필수 식재료들', 58, 7),
	(60, '2022-08-17 10:55:12.970945', '2022-08-17 11:11:55.613175', '<p>그녀의 작품 중 대중적이라고 할 수 있는 카모메 식당을 소개합니다.</p><p>헬싱키를 배경으로 오니기리 식당을 연 사치에의 여정이 펼쳐지는데요~</p><p>별다른 사건 없이 술술 넘어가지만 식당을 찾아오는 다양한 손님들의 사연이 영화의 재미를 더합니다.</p><p>매 신마다 등장하는 요리를 보는 것은 덤! 영화의 색감이 너무 예뻐 당장 헬싱키로 가고 싶어졌습니다. 😋</p>', '', '카모메 식당 (2006)', 59, 15),
	(61, '2022-08-17 11:00:08.512515', '2022-08-17 11:03:49.632642', '<p>2016년 지대넓얕에서 다루면서 다시 한 번 주목을 받은 영화, \'안경\' 입니다.</p><p>조용조용한 일본식 슬로우 무비를 좋아한다면 이 영화는 당신에게 안성맞춤!</p><p>휴대전화가 터지지 않는 곳으로 떠나고 싶었던 타에코가 남쪽 바닷가의 조그만 마을을 방문하며 스토리는 시작됩니다.</p><p>조용하게 살고 싶지만 마을 주민들은 타에코에게 계속 말을 걸고 함께 밥을 먹자고 하고,</p><p>체조도 권하는 아이러니한 상황들이 펼쳐집니다. 뒷 이야기 궁금하지 않으신가요? 😎</p>', '', '안경 (2007)', 60, 15),
	(62, '2022-08-17 11:08:49.088504', '2022-08-17 11:09:44.839279', '<p>오기가미 나오코 감독이 \'고양이를 빌려드립니다\'에서 집중한 감정은 \'위로\'입니다.</p><p>위로의 대상은 \'외로움에 처한 사람들\'인데요.</p><p>영화 속 주인공 사요코는 고양이들이 따르는 특별한 삶을 살고 있습니다.</p><p>고양이를 키우고 빌려주며 마음 속 구멍이 채워지는 것은 아니지만, 외로운 사람들에게 서로가 든든한 벗이 되어줄 수 있다는 영화의 스토리는 사람에 대한 애정을 느낄 수 있습니다. 🧡</p>', '', '고양이를 빌려드립니다 (2012)', 61, 15),
	(63, '2022-08-17 11:30:27.722712', '2022-08-17 11:31:24.007193', '<p>우리 어릴 때를 생각해볼까요? 부모님들은 자식이 책을 읽는 습관을 들이길 원하시죠.</p><p>그래서 어떤 책을 가장 처음 사다주셨을까요?</p><p>제 경우엔 동화책이었습니다. 그리고 생각 나기론 초등학교 5학년 때쯤엔 먼나라 이웃나라도 사주셨고요.</p><p>왜 동화책이었을까요? 연령대에 따른 선입견도 있었겠지만 무엇보다도 재미 때문이었겠죠?</p><p>초등학교 저학년이 철학 책을 읽으면 무슨 재미를 느끼겠어요. 재미가 다인 나이일텐데.</p><p>사실 성인들도 재미가 최우선 순위죠. 재미 있다고 느끼는 책은 종류 가리지 않고 다 읽을 거잖아요.</p><p>그렇기 때문에 제가 추천하는 책은 장르소설도 나쁘진 않다는 거예요.</p><p>성인을 위한 동화라고 불렸던 해리포터도 괜찮죠. 아니 괜찮은 수준이 아니겠네요 ㅎㅎ</p><p>그래서 이 글의 요지는...</p><p>책을 읽고 싶다? 그렇다면 종류는 상관없다. 우선 재밌어 보이는 걸 고르라는 거죠!</p><p>다들 그럼 책 한권씩 포스팅 부탁할게요!</p>', '', '독서의 시작으로 좋은 책은 뭘까요?', 62, 16),
	(64, '2022-08-17 11:38:12.122968', '2022-08-17 11:39:09.539555', '<p>책 좀 읽는다 하는 친구들 주위에 한 둘은 꼭 있죠?</p><blockquote>나 요즘 책 좀 읽어볼려고</blockquote><p><br></p><p>그럼 바로 어떤 말이 돌아올까요? 바로 책 추천이 들어오죠.</p><p>그런데 너무 어렵죠? 뭔가 좀 내 취향은 아닌 것 같고.</p><p>하지만 처음 내딛는 그 첫 걸음이 새로운 분야에 눈을 뜨는 계기가 될 수 있어요.</p><p>그래서 이번 포스팅은 추천 받은 책을 읽고 난 뒤의 후기!</p>', '', '이런 책은 어떠세요? ', 63, 16),
	(65, '2022-08-17 11:45:13.402591', '2022-08-17 11:45:27.306854', '<p>이번 스테이지는 쉽게 추천 받지 않을 책으로 하나 해보려고 해요.</p><blockquote>철학은 어떻게 삶의 무기가 되는가</blockquote><p><br></p><p><br></p><p>50가지 철학(이라 쓰고 한번쯤 생각해볼만한 말들)을 정말 가볍게 다뤄서</p><p>두꺼운 책임에도 불구하고 술술 읽히는 책입니다.</p>', '', '인문학 도서 추천', 64, 16),
	(66, '2022-08-17 11:49:18.922180', '2022-08-17 11:49:53.982458', '<p>전 항상 집 앞에 있는 카페에 가서 책을 읽어요.</p><p>집에 있으면 뭔가 집중이 안 되더라구요.</p><p>다들 어떤 환경이 가장 편하실까요?</p><p>사진 한 컷! 부탁드립니다~~</p>', '', '책을 읽을 때의 환경', 65, 16),
	(67, '2022-08-17 11:58:29.108879', '2022-08-17 12:21:37.480227', '<p>남녀관계, 일과 인생에 대해 명쾌한 해석과 철학이 담긴 작품으로</p><p>드라마를 사랑하는 사람이라면, 반드시 보아야 할 명작, 그들이 사는 세상입니다. 방송국 피디들의 삶을 흥미진진하게 풀어냈습니다.</p><p><br></p><p><strong>간직하고 싶은 대사</strong></p><p class="ql-indent-1">이해할 수 없기 때문에 우린 더 얘기할 수 있고, 이해할 수 없기 때문에 우린 지금 몸 안의 온 감각을 곤두세워야만 한다.</p>', '', '그들이 사는 세상 (2008)', 66, 17),
	(68, '2022-08-17 12:06:14.441707', '2022-08-17 12:11:16.160432', '<p><strong>괜찮아, 사랑이야 마지막 화 재열의 대사</strong></p><p class="ql-indent-1"><span style="color: rgb(5, 5, 5);">저는 그동안 남에게는 괜찮냐 안부도 묻고 잘 자란 굿나잇 인사를 수도 없이 했지만 정작 제 자신에게는 단 한 번도 한 적이 없거든요.여러분들도 오늘 밤은 다른 사람이 아닌 자신에게 \'너 정말 괜찮으냐\' 안부를 물어주고 따뜻한 굿나잇 인사를 하셨으면 좋겠습니다. 그럼 오늘 밤도 굿나잇. 장재열.</span></p>', '', '괜찮아, 사랑이야 (2014)', 67, 17),
	(69, '2022-08-17 12:11:02.617334', '2022-08-17 12:21:58.954146', '<p><span style="color: rgb(51, 51, 51);">찐어른의 이야기가 궁금하다면 디어마이프렌즈를 추천합니다. </span></p><p><span style="color: rgb(51, 51, 51);">우리가 알아차리지 못했을 뿐 각자의 삶은 풍부한 색채로 가득하다는 것을 일깨워준 작품입니다. </span></p><p><br></p><p><strong style="color: rgb(51, 51, 51);">디어 마이 프렌즈 7 화 중 완의 독백&nbsp;</strong></p><p class="ql-indent-1"><span style="color: rgb(51, 51, 51);">&nbsp;죽은 자는 죽은 자, 그래도 산자는 살아야 한다고 분명한 선을 그을 때 사람의 힘으로 할 수 없는 일과 할 수 있는 일을 확실히 분간할 때 어쩔수 없는 모든 것을 순리라고 받아들일 때 나는 어른들이 산처럼 거대하고 위대하고 대단해 보인다.</span></p>', '', '디어 마이프렌즈 (2016) ', 68, 17),
	(70, '2022-08-17 12:20:08.647088', '2022-08-17 12:20:29.065537', '<p>\'아니, 이광수 배우가 이렇게 연기를 잘했단 말이야?\' 라고 깜짝 한 번 더 놀라게 되는 드라마. 라이브 입니다.</p><p>디어마이프렌즈에서 이광수 배우님은 김혜자 배우님의 아들로 열연을 펼쳤습니다.</p><p>이 드라마에서는 경찰로 성장하는 한 청년의 가슴뜨거운 청춘 이야기를 담았는데요.</p><p>끊이지 않는 지구대의 사건 사고가 극의 긴장감을 불어넣습니다.</p><p>수사물을 좋아하시는 분들도 도전하실 수 있는 드라마입니다.</p>', '', '라이브 (2018)', 69, 17),
	(71, '2022-08-17 13:07:54.798909', '2022-08-17 13:07:54.798909', '<p>백 번 읽고 백 번 배운다는 말입니다. 세종대왕님의 독서법이라고도 알려진 이것은 한 책을 두고 하는 말인데</p><p>사실 한 번만 읽고 그 책을 다시는 펴보지 않는 일이 많습니다.</p><p>제 경우엔 부분부분 다시 펼쳐보거나 하는데요. 제게도 수차례 다시 읽어본 책이 있습니다.</p><p>셜록 홈즈, 드래곤 라자, 동천 이 세 가지 정도가 아마 제가 수십차례 읽은 책이 되겠네요.</p><p>셋 다 장르소설이라는 공통점이 있어요. 하지만 그 깊이가 얕지 않아 다시 읽을 때마다 정말 새로 읽는 듯한</p><p>느낌을 준다는 특징도 있죠.</p><p>책의 범위를 좀 더 넓힌다면 우리가 학창시절에 닳도록 봐왔던 학습서들도 마찬가지 일 수 있겠네요.</p><p>처음엔 이해 안 갔던 것들이 다시 보니 이해되는 현상, 또는 새롭게 이런 내용이 있었나 하는 느낌. 뭔지 아시겠나요?</p><p>이번 포스팅으로는 본인이 다시 읽으며 느낀 후기를 작성해주세요! 그 어떤 것이라도 좋아요</p>', '', '백독백습, 세종대왕님의 습관', 70, 16),
	(72, '2022-08-17 13:14:33.820637', '2022-08-17 13:14:33.820637', '<p>책을 읽는다는 행위의 끝은 어딜까요?</p><p>감히 제가 정의해보고자 한다면 책을 덮은 뒤에 그 내용을 머릿속에서 이리저리 굴려보는 것입니다.</p><p>추리소설처럼 범인이 확실시되고 이야기의 결말이 확정적인 경우는 사실 이럴 일이 별로 없죠.</p><p>하지만 주인공들의 심리가 명확히 묘사되지 않고 열린 결말로 끝나거나, 또는 등장인물의 언행이 선뜻</p><p>이해가 가지 않으면서도 한편으로는 뭔가 알 것 같은 모순적인 느낌이 들 때</p><p>책을 덮었기 때문에 생각을 멈춘다는 것은 아직 책을 다 읽은 것이 아니게 됩니다.</p><p>책의 마무리를 포스팅해주세요. 독후감도 좋고, 그저 짧은 문구도 좋습니다.</p><p>책을 생각하며 덮어주세요. 이번 포스팅은 이걸로 하겠습니다!</p>', '', '책을 덮고 나서, 마무리 ', 71, 16),
	(73, '2022-08-17 13:24:15.770918', '2022-08-17 13:24:58.024725', '<p>우리 사회에서 노력은 매우 높게 평가 받는 요소 중 하나입니다.</p><p>하지만 노력은 항상 보상 받을까요?</p><p>제가 대학교 1학년 때 조교가 했던 말은 그 때의 저에게 크나큰 불편함을 안겼습니다.</p><p>매일 5시간씩 노력했지만 시험을 못 본 사람과, 수업도 안 나오고 숙제도 대충 내지만 시험 하나는 기깔나게 보는 사람</p><p>이 둘 중 누가 더 좋은 학점을 받아야 하는가에 대한 질문이었죠.</p><p>조교는 후자라고 말했습니다. 그 때의 저는 이해하지 못했지만요. 정확히는 안타까워했달까요?</p><p>하지만 그럼에도 우리는 노력해야 합니다. 왜 그럴까요? 포스팅에 본인이 생각하시는 그 이유를 올려주세요!</p>', '', '노력은 항상 보상 받을까요?', 72, 18),
	(74, '2022-08-17 13:27:55.493228', '2022-08-17 13:27:55.493228', '<p>나치가 전쟁에서 진 뒤 유대인 학살의 실무 책임자 중 하나였던 아돌프 아이히만은 재판에 서게 되었죠.</p><p>그는 자신이 그저 시스템의 하나로써 일했기에 무죄라고 했습니다.</p><p>죄책감도 없이 말이죠. 가장으로써 그의 모습은 어땠을까요? 친절하고 자상하고 가정에 충실한 그런 남편이었죠.</p><p>이걸 보고 철학자 한나 아렌트는 이렇게 말했습니다. 악은 평범하다고요.</p><p>사실은 좀 더 깊은 내용이 숨어있지만... 지면이 좁아 다 담기는 무리로 보여요.</p><p>여러분도 한번 생각해보세요. 주위에 평범을 가장한 악이 있진 않나요?</p>', '', '악은 평범하다.', 73, 18),
	(75, '2022-08-17 13:33:18.862699', '2022-08-17 13:34:03.258599', '<p>우리는 상황에 따라 완전 다른 모습을 보여주기도 합니다. 아니라고요?</p><p>하지만 상상해보세요. 면접을 보는 당신, 좋아하는 애인과 첫 데이트를 앞둔 모습, 혼자 사색하는 당신</p><p>항상 일정한 모습이 아니죠. 우리는 이걸 페르소나라고 부릅니다. 그 때 그 때마다 우리가 쓰는 가면이란 뜻이죠.</p><p>사람들은 이걸 인식하곤 처음엔 어색해합니다. 자기 자신이 정말 진정한 나라고 정의한 페르소나야 말로 진짜라고 생각하죠.</p><p>하지만 그건 모두들 여러분입니다. 여러분은 어떤 페르소나를 가지고 있나요?</p><p>저는 좋아하는 사람 앞에선 평소의 유머러스한 모습을 반에 반도 못 보여주더라고요 ㅎㅎ</p>', '', '여러분은 어떤 가면을 쓰고 있나요?', 74, 18),
	(76, '2022-08-17 13:37:42.412582', '2022-08-17 13:38:40.633526', '<p>철학자 니체는 이렇게 말했죠. 신은 죽었다고요.</p><p>이것은 니체의 시대적인 맥락을 짚어보자면, 더 이상 인간의 삶에서 신의 자리는 없어졌음을 뜻합니다.</p><p>사람들이 내세와 현세 사이에서 중요하게 생각하는 비중이 현세로 많이 옮겨왔다는 뜻인거죠.</p><p>하지만 그럼에도 오늘날까지 신의 자리는 굳건히 지켜지고 있는 것처럼 보입니다.</p><p>물론 전 세계적으로 줄고 있는 종교인들의 숫자를 보면 또 아닌 것 같기도 하구요.</p><p>신이라는 절대적인 가치의 부재 속에서 우리 인간은 어떤 가치를 찾아야 할까요?</p><p>니체는 자기 발전이라고 말했지만 여러분은 어떻게 생각하세요?</p>', '', '니체의 신은 죽었다는 말 무슨 뜻이죠', 75, 18),
	(77, '2022-08-17 13:49:59.879129', '2022-08-17 13:56:01.788505', '<p>한 때는 카를 마르크스의 자본론이 금서인 시절이 있었다고 들었어요.</p><p>현재 공산주의를 표방하는 국가들의 패악질을 보면 잘못된 사상처럼 느껴지기도 하죠.</p><p>근데 뭐 실제로 가능한 사상인지 아닌지를 떠나서</p><p>마르크스가 자본주의를 비판한 점은 지금도 알아볼 정도로 명쾌하다고 생각합니다.</p><p>분업으로 인해 노동자들은 자아실현의 가치를 잃게 되고, 그 생산물의 소유권도 다른 이에게 이에게 넘어가죠.</p><p>여기서 오는 노동의 가치의 상실은 충분히 생각해볼만 합니다.</p><p>점점 간편화 되고 고도화되는 노동의 단계에서, 아직도 육체적인 노동은 반드시 필요한 것입니다.</p><p>하지만 아무도 하려고 하지 않죠. 사실 우리는 노동을 다시 한번 바라보아야 하는 게 아닐까요?</p><p>여러분의 의견을 포스팅해주세요!</p>', '', '마르크스와 자본주의', 76, 18),
	(78, '2022-08-17 13:59:49.448052', '2022-08-17 14:00:15.179150', '<p>페미니즘의 대두와 함께 우리 사회는 인터넷에서 매일 성별 갈등이 대두 되고 있습니다.</p><p>그러한 여조를 반영해 정치권에서도 성별 갈등은 화두가 된 지 오래구요.</p><p>어느 한 쪽이 옳고 어느 한 쪽이 틀리다의 얘기를 하는 것이 아닙니다.</p><p>다만 이 끝이 어디로 향할지는 우리가 알아야 한다는 거죠.</p><p>다들 어떻게 생각하세요? 사실 저는 그 끝은 절대 오지 않을거라고 생각할 때도 있습니다.</p><p>가만히 지켜보면 서로에 대해 왜곡된 인상만 덧칠해가며 진정한 소통은 이루어지지 않고 있다고 생각하거든요.</p><p>자신과 비슷한 사람들끼리 뭉치며 확증편향이 되는 이유도 있겠죠.</p><p>여러분은 다들 어떻게 생각하세요?</p>', '', '남녀 성별 갈등 그 끝은 어딜까요?', 77, 18),
	(79, '2022-08-17 14:09:32.229101', '2022-08-17 14:10:32.674799', '<p><span style="color: rgb(77, 81, 86);">논문 "프로테스탄트 윤리와 자본주의 정신" 으로 유명한 막스 베버는</span></p><p><span style="color: rgb(77, 81, 86);">남을 이끄는 자가 가져야 할 것으로 세 가지를 뽑았습니다. 각각 하나씩만 가져도 되죠.</span></p><p><span style="color: rgb(77, 81, 86);">리더의 카리스마, 합법성, 그리고 리더라는 자리가 과거부터 존재해왔다는 사실 이 세 가지 입니다.</span></p><p><span style="color: rgb(77, 81, 86);">여기서 말하는 카리스마는 개인의 남다른 자질이라고 볼 수 있죠.</span></p><p><span style="color: rgb(77, 81, 86);">얼핏 보면 당연한 소리처럼 들립니다. 반장 선거, 또는 회사에서의 팀장 역할 등은 모두 합법적인 절차를 거치고</span></p><p><span style="color: rgb(77, 81, 86);">예로부터 항상 누군가는 이끄는 역할이었죠.</span></p><p><span style="color: rgb(77, 81, 86);">카리스마 또한 마찬가집니다. 뛰어난 사람이 아니면 당연히 사람이 따르지 않을 테니깐요.</span></p><p>그렇다면 카리스마는 타고나는 걸까요? 여러분의 생각을 적어주세요!</p>', '', '남을 이끄는 자가 되기 위해서는', 78, 18),
	(80, '2022-08-17 14:15:44.924971', '2022-08-17 14:46:41.116395', '<p><strong>멕시코에 프리다 칼로가 있다면, 한국에는 천경자 화백이 계십니다.</strong></p><p>그녀의 작품은 왠지모를 쓸쓸함을 담고 있어요.</p><p>인물화에서 눈을 바라봤을 때, 외로움이 느껴져 발길을 돌리기 힘들었습니다.</p><p>사랑하는 동생의 죽음, 결혼의 실패와 첫 딸의 출산 등 그녀의 삶이 화려하지만은 않았습니다.</p><p>천경자님의 작품을 찾아보고 어떤 감정이 들었는지 공유해주세요~</p>', '', '화려하지만은 않았던 삶, 천경자 화백', 79, 20),
	(81, '2022-08-17 14:19:23.820749', '2022-08-17 14:19:29.400441', '<p>치킨먹여드려요</p>', '', '배그 할사람 없음?', 1, 21),
	(82, '2022-08-17 14:23:22.837271', '2022-08-17 14:23:22.837271', '<p>화분은 식물들의 집이자 안식처 입니다.</p><p>씨앗을 막 심는 시기에는 아무 크기나 상관 없어요!</p><p>하지만 좀 작은 것이 관리하기 편하겠죠?</p><p>화분이 없다면 큰 스티로폼 박스라도 준비해보도록 합시다!</p>', '', '화분 준비', 81, 19),
	(83, '2022-08-17 14:27:06.310223', '2022-08-17 14:29:00.889743', '<p>고구마 키우기는 어렵지 않아요.</p><p>현실적으로 고구마 씨앗을 구하기는 어려우니</p><p>동네 마트로 가서 고구마를 하나 사와 넓찍한 화분이나</p><p>화단이 있다면 거기에 심어보도록 해요!</p><p>불가피하게 심을 곳이 없다면 플라스틱 컵을 활용해 물을 주어도 된답니다.</p>', '', '고구마 키우기', 82, 19),
	(84, '2022-08-17 14:28:29.255959', '2022-08-17 14:46:49.348890', '<p>우리나라 모더니즘의 1세대이며, 한국보다 외국에서 더 가치를 인정받고 있는 작가, 김환기 화백입니다. 저는 그의 점묘화를 사랑합니다. 밤하늘을 보는 것처럼 그의 작품은 마음의 눈을 통해 색의 오묘한 조합을 온전히 느끼게 해주기 때문이죠.</p><p>&lt;어디서 무엇이 되어 다시 만나리&gt; 라는 제목은 너무 멋지지 않나요?</p><p>처음엔 작품과 매치가 되지 않지만 색과 형태가 주는 압도감은 그림 앞에서 할말을 잃게 만듭니다. 저는 여러분들이 이번 기회를 통해서 그의 다양한 작품 세계를 탐험하셨으면 좋겠습니다. 한 형태에 얽매이지 않는 다양한 시도를 한 작가님이기 때문에 취향에 맞는 작품을 찾으실 수 있을거에요!</p>', '', '점묘화의 대가, 김환기 화백', 83, 20),
	(85, '2022-08-17 14:30:26.290455', '2022-08-17 14:31:47.601263', '<p>토마토는 고구마와는 약간 달라요!</p><p>물빠짐이 좋고 햇빛이 잘 드는 곳에 심어주면 됩니다.</p><p>토마토는 성장속도가 매우 빠르기 때문에</p><p>정말로 키우는 재미가 있을거에요.</p><p>멈춰있는 것 같은 식물들도 정말 빠르게 성장한다구요!</p>', '', '토마토 키우기', 84, 19),
	(86, '2022-08-17 14:35:23.407335', '2022-08-17 14:37:28.577295', '<p>제철 과일은 정말 많아요!</p><p>정말 매달 여러 과일들이 끊임없이 나오죠</p><p>요즘에는 사계절 키우기 쉽도록 개량된 품종들도 많습니다.</p><p>봄이라면 딸기 🍓</p><p>여름이라면 수박🍉등!</p><p>집에서 먹고 남은 씨앗을 한번 심어보도록 해요!</p><p>앞선 두 번의 키우기로 잘 키우실 것이라 믿습니다.😊</p>', '', '제철과일 키우기', 85, 19),
	(87, '2022-08-17 14:39:31.072336', '2022-08-17 14:39:31.072336', '<p>여러 식물을 키워보고 느낀 점이 많았나요?</p><p>이처럼 식물은 식량으로도, 친구로도 함께할 수 있는 존재랍니다.</p><p>날이 좀 선선해졌다면, 가볍게 동네 뒷산이라도 가보는건 어떨까요?</p><p>천천히 숲속을 거닐면서 평소에는 쉽게 지나쳤던 자연을</p><p>맘껏 느껴보도록 합시다.🏞️</p>', '', '자연 느껴보기', 86, 19),
	(88, '2022-08-17 14:41:54.614902', '2022-08-17 14:47:13.466050', '<p>미국의 잭슨 폴록이 선의 거침에 초점을 맞췄다면, 한국의 이우환 화백은 선의 품격을 한층 높이는 것에 더 집중했다고 생각합니다. 그의 작품 앞에 서있노라면, 마치 물안개 가득한 새벽 속에 서있는 듯한 느낌을 받습니다. </p><p>전 추상미술을 그렇게 좋아하진 않지만, 여백이 가득한 화면 위에 점들이 진해졌다 흐려졌다를 반복하는 그의 작품은</p><p>오랫동안 저의 발길을 붙잡았습니다. 여러분들은 어떤 느낌이 드셨나요? 이우환 화백의 작품을 찾아보거나 미술관을 방문하여 작품을 감상해 봅시다. 그리고 어떤 느낌이 들었는지 공유해주세요~</p>', '', '점, 선, 여백의 대가. 이우환 화백', 87, 20),
	(89, '2022-08-17 15:08:12.583066', '2022-08-17 15:10:25.951627', '<p>지용은 클래식 연주자로서 조금 특이합니다.</p><p>변화를 두려워하지 않고 파격적인 콜라보에 매 번 도전하는 피아니스트 입니다.</p><p>그런 그가 정통음악의 대가 바흐를 연주한다니 처음에는 잘 매칭이 되지 않았습니다.</p><p>지용의 골든베르크 변주곡을 글렌굴드의 골든베르크 변주곡과 비교하여 들어보세요.</p><p>다른 스타일을 확연히 느끼실 수 있을겁니다.</p>', '', '지용의 골든베르크 변주곡', 88, 23),
	(90, '2022-08-17 15:12:49.707558', '2022-08-17 15:12:49.707558', '<p>쇼팽 콩쿨에서 당당히 우승을 차지하며 일약의 스타로 떠오른 피아니스트, 조성진입니다.</p><p>조성진의 피아노는 섬세합니다.</p><p>그 섬세함을 잘 느낄 수 있는 앨범, 드뷔시 앨범입니다.</p><p>피아노에 닿는 손가락 끝의 세기가 얼마나 예민한지 드뷔시의 달빛을 들어본다면 공감하실 수 있을겁니다.</p>', '', '조성진의 드뷔시', 89, 23),
	(91, '2022-08-17 15:18:27.843026', '2022-08-17 15:21:20.819365', '<p>아니 라흐마니노프가 누구길래 저렇게 대단한거야?</p><p>러시아의 낭만주의 대표자, 라흐마니노프는 극한의 연주 기법과 초인적인 표현력을 요구하는 작품으로 유명합니다.</p><p>손이 작다는 이유로 자신이 작곡한 작품을 한 번도 연주하지 않았다는 사실만으로도 얼마나 난이도가 높은지를 예상할 수 있습니다.</p><p>피아니스트들이 연주하기를 극도로 꺼린다는 라흐마니노프, 완벽하게 연주된 적이 손에 꼽힐정도라는 라흐마니노프 협주곡 3번을 광기에 가까운 연주로 임윤찬이 세계에 선보인겁니다.</p><p>그 충격이 얼마나 대단했던지, 그자리에 있던 청중의 기립박수가 끊이지 않았다고 하죠. 이번 기회를 통해 라흐마니노프의 작품을 한 번 감상해보는건 어떨까요?</p><p><br></p>', '', '세계를 감동시킨 피아니스트, 임윤찬', 90, 23),
	(92, '2022-08-17 17:11:28.335058', '2022-08-17 17:12:01.501779', '<p><strong>spring boot 프로젝트를 생성한다.</strong></p>', '', '백엔드 프로젝트 생성', 2, 28),
	(93, '2022-08-17 17:11:43.440944', '2022-08-17 17:12:01.457389', '<p><em>react 프로젝트를 생성한다!</em></p>', '', '프론트엔드 프로젝트 생성!', 1, 28),
	(94, '2022-08-17 17:11:54.680216', '2022-08-17 17:12:01.571192', '<p>생성한 프로젝트들을 배포한다!</p>', '', 'AWS 배포하기!', 3, 28),
	(95, '2022-08-18 10:12:49.724502', '2022-08-18 10:20:44.761602', '<p>추억이 솜구름처럼 떠올라요</p>', '', '윤도현의 빗소리를 들으면', 94, 29),
	(96, '2022-08-18 10:20:23.236994', '2022-08-18 10:20:23.236994', '<p>내 말에 동의하는 사람들 모두 손 머리 위로 </p>', '', '꽃이 사람보다 아름다워', 95, 29),
	(97, '2022-08-18 10:24:15.279750', '2022-08-18 10:24:15.279750', '<p>7080 노래들이 그렇게 좋았는데</p>', '', '배철수의 음악캠프가 그립다', 96, 29),
	(98, '2022-08-18 11:36:20.282551', '2022-08-18 11:40:16.946793', '<p>가장 간단히 할 수 있는 " 선 " 을 그려봅시다.</p><p>대신 직선이 아닌 펜툴로 그려볼거에요!</p><p>다음의 툴을 사용합니다</p>', '', '선 그리기 ', 97, 27),
	(99, '2022-08-18 15:34:02.910775', '2022-08-18 15:35:09.760367', '<p><span class="ql-size-large">광주에 있는 산 중 하나인 무등산은</span></p><p><br></p><p><span class="ql-size-large">국립공원으로 지정되어 있고, 무등산 수박으로 유명하다!</span></p>', '', '지리산에 가보자!', 2, 31),
	(100, '2022-08-18 15:34:24.930499', '2022-08-18 15:35:09.760367', '<p><span class="ql-size-large">대한민국 국민이라면 누구나 아는 설악산을 가보는건 어떨까?</span></p>', '', '설악산은 어때?', 1, 31),
	(101, '2022-08-18 15:35:00.759367', '2022-08-18 15:35:09.760367', '<p><span class="ql-size-large">여름철 계곡으로 유명한 지리산!</span></p><p><br></p><p><span class="ql-size-large">등산으로도 정말 유명합니다.!</span></p>', '', '지리산도 좋아요!', 3, 31),
	(103, '2022-08-19 00:12:31.530749', '2022-08-19 00:34:44.003179', '<p>여름의 1등성 고문고자리 베가, 백조자리 데네브, 독수리자리 알타이르를 이으면 삼각형이 되는데 이를 여름의 대삼각형이라고 합니다. 맑은 날 여름 은하수 굵은 쪽 하늘에서 유난히 밝은 별 3개만 찾으면 되는데요.</p><p>그럼 은하수는 어디있지? 궁금하시죠? 대한민국은 북반구이고 북반구의 경우 남쪽에 은하수가 있습니다.</p><p>은하수는 매우 큰 크기로 나타나기 때문에 육안으로 관찰가능하고, 그 속 가장 빛나는 별 3개 그것이 바로 여름의 대삼각형입니다. 요즘은 앱으로도 별자리를 쉽게 찾을 수 있으니 함께 이용해보는 것도 추천합니다.</p>', '', '여름의 대 삼각형', 2, 32),
	(104, '2022-08-19 00:19:00.364515', '2022-08-19 00:19:06.336176', '<p>별자리는 쉽게 알고, 익숙한 별자리를 찾는 것 부터 시작하는 것이 좋습니다.</p><p>길을 잃으면 길잡이가 되어주는 별자리는? 바로 북극성입니다.</p><p>왜 북극성을 길잡이 별일까요? 어느 별을 찾든 그 별을 기준으로 방향을 정하고 하나하나 다른 별을 찾을 수 있는 기준이 되기 때문인데요. 북극성은 도시의 밤에서도 반짝반짝 빛이 납니다.</p><p>오늘 저녁, 고개를 들어 여러분 머리 위 가장 빛나고 있는 별 북극성을 찾아보세요!</p>', '', '북극성을 찾자.', 1, 32),
	(105, '2022-08-19 00:22:27.052591', '2022-08-19 00:34:37.932781', '<p>그레다섬의 오리온이 같이 사냥하던 사냥의 여신인 알테미스에게</p><p>"이 세상에 퇴치할 수 없는 동물은 하나도 없다" 라고 소리친 것을 들은 헤라여신이 크게 화를 내며 보낸 것이 전갈이라고 합니다. 전갈은 맹독, 단 한침으로 오리온을 찔러 죽였다고 하죠. 그래서 그런지 전갈자리가 동쪽 하늘에 나타나기만 하면, 오리온자리는 서쪽 지평선으로 급히 빠져 버린다고 합니다. 재미있지 않나요?</p><p>이처럼 별자리는 자신만의 스토리들을 가지고 있습니다. 스토리와 함께 별자리를 찾아본다면 별자리르 더 쉽게 찾고 재미를 느낄 수 있지 않을까요?</p>', '', '88개나 되는 별들의 이음, 전갈자리', 103, 32),
	(106, '2022-08-19 00:26:39.993105', '2022-08-19 00:26:50.985700', '<p>반은 말, 반은 사람인 케타우루스족 가운데서 아주 우수한 학자였던 케이론.</p><p>헤르큘레스가 켄타우루스족과 싸우고 있을 때, 그가 쏜 화살이 잘못되어 케이론의 무릎에 맞았습니다.</p><p>불사신이었지만 약을 써도 독화살의 아픔은 대단하여 의술이 효력이 없었습니다.</p><p>그래서 케이론은 자신의 몸을 거인 신인 플로메데우스에게 양도하고 죽고 말았습니다.</p><p>제우스는 그의 위대한 업적을 기리기 위해 활을 쏘는 반인반마의 케이론을 하늘로 올려 별자리를 만들었다고 하는데요.</p><p>늠름한 궁수자리 한 번 찾아보지 않으시겠어요?</p>', '', '궁수 자리', 104, 32);
